INSERT INTO `users` VALUES (19,'AKSARTEKS INDUSTRY','White Eagle, Britela',NULL,'aksarteksindustry@gmail.com',NULL,'1','Узбекистан',0.00,1,'3','2007','member','$2y$10$AF4zIL4aQEeij.RJaqFIvOJl0cXDNtP7p8UjyKwG9.Fdo5UwQaPlS','Aksarteks Industry” company is one of the major manufacturers of textile products in Uzbekistan since 2007. Based on our many years of experience and high-tech automated production, “Aksarteks” offers customers quality products, mutually beneficial and long-term conditions of cooperation.',NULL,'++998500080097','+998 50 008 00 97','aksartex.com','+998 50 008 00 97','4','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/sm/3g/42/be556ed5-f7f0-4f5c-8530-3da2feb45aa0.jpg',0.00,NULL,NULL,'2025-08-04 16:31:32','2025-08-04 16:31:32'),(20,'Davr Cargo','Davr Cargo',NULL,'davrkargo@gmail.com',NULL,'5','Узбекистан',0.00,1,'1','2010','member','$2y$10$/rHYaK4RWaGQr1DaRul4uO33RpCA4mCBMy7fxGhBdMl/Mj6t99KeO','Надежная, быстрая и конкурентоспособная доставка грузов из Китая в Узбекистан - консолидация контейнеров (полных и сборных), автомобильным и железнодорожным транспортом.',NULL,'t.me/+@DavrCargo','+998 98 222 20 40','https://davrcargo.uz','+998 97 420 75 40','Не указано','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/t0/qb/qz/ca240283-407e-43ed-a016-a5ae4a491fbb.png',0.00,NULL,NULL,'2025-08-04 16:31:32','2025-08-04 16:31:32'),(21,'Edem-Textile','Edem Textile',NULL,'elshod0909@icloud.com',NULL,'1','Узбекистан',0.00,1,'3','2013','member','$2y$10$nwUNuFqV1kGZ1xWK5yHkKuqpGWlm3M6tiQbcegReRSWTOQ3bz8jyO','Edem Textile является одной из современных, динамично развивающихся компаний Навоинской области Республики Узбекистан.\n\nМы стремимся добиться высокого качества благодаря современным ткацким оборудованием.  \n\nК примеру:\n\nТкацкое оборудование PINACOL OPTIMAX\" Бельгия.\n\nШлихтовальное оборудования \"BENNINGER\" Швейцария.\n\nСновальное оборудования \"BENNINGER\" Швейцария.\n\nПроизводственная мощность предприятия 1 млн. 200 тысяч погонных метров ткани в год.\n\nУ предприятия имеются такие направления как:\n\nТкацкое: производство ХБ и смесовых тканей\n\nШвейное: пошив КПБ, спецодежды, носовые и платки, вафельное полотенце.\n\nМы производим такие тканы как:\nОтбелённое вафельное полотно.\nГладко крашеная хлопчатобумажная одежная ткань.\nГладка крашеная хлопкополиэфирная ткань.\nСуровая бязь.\nТкань TWILL.\n\nВ производстве, так же имеются:\nБрезентовые утеплённые рукавицы.\n\nНаша компания делает ставку на долгосрочную работу с партнёрами. Мы готовы к сотрудничеству и рады обсудить деловые предложения.',NULL,'+998 90 7179815','+998907179815',NULL,NULL,'undefined','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/rd/4q/6z/6be3dae1-e9a8-4034-920c-1e1b80f2949d.png',0.00,NULL,NULL,'2025-08-04 16:31:32','2025-08-04 16:31:32'),(22,'FATİHİM TEKSTİL A.Ş.','Vişne Bebe',NULL,'fatihim@fatihimtekstil.com.tr',NULL,'1','Турция',0.00,1,'1','1987','member','$2y$10$aK/nc8ZhQYuhtJeB77U06.8m6f/JiSI1n4p0TvT.hb9Nr/lriTTPG','Компания «Fatihim Tekstil» («Vişne Bebe») начала свою деятельность в 1987 году. Компания занимается производством и оптовой продажей детской одежды для детей от 0 до 16 лет. Сегодня «Фатихим Текстиль» экспортирует свою продукцию в более чем 40 стран мира.',NULL,'visnebebecom','+902243612157','visnebebe.com','+905070703282','6','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:31:32','2025-08-04 16:31:32'),(23,'FT TEXTILE GROUP LLC','',NULL,'elvina@bakantex.com',NULL,'1','Узбекистан',0.00,1,'3','2016','member','$2y$10$37E1DS8sXs43BrjRLQgO7eZzEZgFUkwDSAlu0KfdwzDV2RM5EsmcC','Текстильная фабрика по производству х/б пневмопрядильной пряжи и сурового полотна',NULL,'+998974697004','+998974697004','www.fttextilegroup.com','+998974697004','undefined','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/xg/zh/3i/4fa92344-2142-43af-a056-558f37e2db2a.png',0.00,NULL,NULL,'2025-08-04 16:31:33','2025-08-04 16:31:33'),(24,'Global Textile','',NULL,'info@global-textile.com',NULL,'1','Узбекистан',0.00,1,'6','2015','member','$2y$10$ef.723ZZNWa66xOzlW2tquNCZefnWVPGmzfi.sgH3rs8sDLvmsucC','Global Textile - одна из ведущих текстильных компаний в Узбекистане, производящая пряжу, суровое и крашенное трикотажное полотно, а также готовую одежду.',NULL,'globaltextilegroup','+998712318601','https://global-textile.com/',NULL,'undefined','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/d0/8x/g6/86cb730b-b032-44e9-bbb0-7e316e112880.png',0.00,NULL,NULL,'2025-08-04 16:31:33','2025-08-04 16:31:33'),(25,'GLOBAL TEXTILE INFINITY','',NULL,'Ilhom.Sobirov@global-textile.co',NULL,'1','Узбекистан',0.00,1,'4','2016','member','$2y$10$TnuZ7pGVjUuiFGtgYgU1he6LgXMelX2FaKZtxIBROAlzlQKh/0hj.','Производства компактно-гребенной пряжи  (72 тонн в сутки Rieter K48) \nПроизводства трикотажного сурового полотна (25 тонн в сутки Mayer and Cie)',NULL,'IlkhomSobirov','+998990295414',NULL,NULL,'1','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/5m/zy/k4/309046f8-c8d7-4fde-9897-8e35a466f3af.jpg',0.00,NULL,NULL,'2025-08-04 16:31:34','2025-08-04 16:31:34'),(26,'KISDSBEE','KIDSBEE',NULL,'MghbxwcCQf@example.com',NULL,'1','Узбекистан',0.00,1,'1','2020','member','$2y$10$EJFtA/.PogKudAZnAD8Mtu/guq7u2ACMHo45wR3xXhnuO0QYYxMX2','Производство детской одежды',NULL,'t.me/+998908797979','+998 90 879 79 79',NULL,'+998 90 879 79 79','Не указано','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:31:34','2025-08-04 16:31:34'),(27,'OOO \"GAS SMART GROUP','BAOYU Швейные машины',NULL,'elvira@baoyu.uz',NULL,'3','Узбекистан',0.00,1,'1','2015','member','$2y$10$zHB3EMVJ5A9LcRbZixB.HOUbvoMR8vCSlSEOn5GewUBeYEW5EiVjG','Компания BAOYU SEWING MACHINE CO., LTD была основана в 1999 году и специализируется на производстве высококачественных промышленных швейных машин. Каждый год на заводе собираются более 400 000 единиц и отправляются на местный рынок в Китае, так и на экспорт. В производственно-сборочном процессе уделяется внимание качеству каждой части, каждому винтику машины. Промышленные швейные машинки BAOYU SEWING MACHINE являются высокоскоростными, многофункциональными, интеллектуальными и энергосберегающими. Энергосберегающие серво-моторы, устанавливаемые на швейные машины BAOYU, поставщиком которых является один из лидеров в Китае, компания QIXING, отличающиеся высокой надежностью. Помимо своего собственного бренда BAOYU, на заводе также размещаются аутсорсинговые заказы такие как SIRUBA.\nВ 2003 года был организован экспорт в 38 стран мира, и на сегодняшний день швейные машины BAOYU, экспортируется в более чем 80 стран мира. В 2006 году, в компании BAOYU внедрена интеграционная система управления ERP. В 2009 году, завод расширил свои производственные мощности. Начиная с 2013 года, наступает новая эра развития компании. Компания BAOYU SEWING MACHINE признана как производитель высококачественных машин и становиться одним из лучших брендов в Китае. Компания BAOYU имеет стратегическое сотрудничество с всемирно известными фабриками на протяжении многих лет; мы вместе способствуем прогрессу и развитию мировых промышленных швейных машин. При заготовке частей и сборке швейных машин, используется стандарты и оборудования от ведущих немецких и японских поставщиков.\n2021 года производственные мощности компании, были увеличены в два раза, за счет расширения территории завода и увеличения производственных линий и складских помещений. К 2022 году объем выпуска швейных машин BAOYU увиличелся до 600 000 единиц в год. \nOOO «GAZ SMART GROUP» является, авторизованным представителем торговой марки BAOYU в Узбекистане. Наша задача предложить Вам полный ассортимент надежных и проверенных машин для швейного производства со стабильным качеством. Мы предоставляем гарантийное обслуживание каждой единицы купленного у нас оборудования.\nМы нацелены на то, чтобы покупки в нашей компании приносили Вам только высокую производительность, экспортное качество шва, позитивные эмоции и уверенность. В наших планах совершенствование всех торговых процессов, включая регулярные поставки новинок швейной индустрии.\n',NULL,'+998974021681','+998995204499','www.baoyu.uz','+998995204499','4','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/2z/fo/sw/073c22e9-4e51-40a9-b905-f97a22ce35be.jpg',0.00,NULL,NULL,'2025-08-04 16:31:34','2025-08-04 16:31:34'),(28,'OOO \"Marg`ilon Umar Textile\"','MUTex',NULL,'mutekstile@gmail.com',NULL,'1','Узбекистан',0.00,1,'3','2014','member','$2y$10$q7zl.3LnkDaEgDLR/qpy3uXdlrHpMvYLaZnxMKDBNLmSk1q3/UurG','Мы производим более 1,5 млн. пар мужских, женских,   детских, спортивных, махровых и  универсальных носочных  изделий в месяц. Вязальный, гладильный и упаковочный  процесс осуществляется на современных технологиях Италии,  Турции и КНР.  В производстве мы используем исключительно  экологически чистое сырье, преимущественно из местного  узбекского хлопкового волокна. Кроме того, нами импортируются  пряжа и синтетическое волокно из Китая, Турции и Индии. Наша продукция отвечает высоким стандартам качества,  что является результатом постоянного контроля качества  момента ввода сырья для изготовления, и на протяжении всех процессов до окончательной проверки, упаковки и отправки.',NULL,'t.me/++998917073377','+998916791000','mutex.uz','+998917073377','4','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/l5/6y/r3/fd99d45b-dfbd-4e87-bb9e-0bab9e4a4dd0.jpg',0.00,NULL,NULL,'2025-08-04 16:31:34','2025-08-04 16:31:34'),(29,'OOO NAZAR TEXTILE','LUSSO, GIOVANNI',NULL,'Lussoheadsales@mail.ru',NULL,'1','Узбекистан',5.00,1,'3','2015','member','$2y$10$tLuPV9F52cV94VKpRugxhODEtip.B/bQ0.ehpJPthDHW32XYJFFs6','OOO NAZAR TEXTILE в 2015 году открыл первый цех по производству трикотажной одежды с 15 сотрудниками. К 2018 году цех увеличился до 60 человек, и в этом году началось производство свитеров. С 2021 года запущен цех по производству ткацких швейных изделий, в настоящее время в компании работает более 160 сотрудников.  \nМесячный объём производства; \nТрикотажный цех 50,000-60,000 штук футболок, \nТкатский цех 3000-5000 комплект спецодежды, \nПлосковязалный  цех 7000 свитеров в месяц\nМинимальный объём заказа; от 500 штук',NULL,'t.me/+998903554507','+998 90 354 45 07',NULL,'+998 90 354 45 07','undefined','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/o8/4s/kg/84d61fa6-32ee-4a19-847d-c820821a6281.png',0.00,NULL,NULL,'2025-08-04 16:31:34','2025-08-04 16:31:34'),(30,'OOO \"STAMPA TEXTILE\"','STAMPA',NULL,'ilxom.mirbabayev@stampa.uz',NULL,'1','Узбекистан',5.00,1,'3','2015','member','$2y$10$B94wzM6WeyvmE4Uk0toMOeiqpkNfqmPwLFTs142x4cGlCbHrs2r4e','Компания «Stampa textile» является производителем гладкоокрашенных и печатных трикотажных полотен всего ассортиментного ряда. Окрашивание полотен осуществляется на производственных линиях «Dilmenler Group» (Турция) с использованием красителей и химикатов ведущих мировых производителей. Предварительная обработка тканей (удаление пуха) производится на газо-опальном оборудовании «MERSAN». Цифровая печать на тканях выполняется на современном, высокотехнологичном оборудовании MS Printing Solutions S.R.L. – MS JPK Evo (Италия). Кроме трикотажных полотен наша компания предоставляет услугу по окрашиванию и цифровой печати на ткацких материалах, в том числе бязь, сатин, поплин, миткаль и др. Особенностью нашего производства является возможность печати на натуральном шелке. В разделе портфолио размещены фото готовой продукции, выполненные нашей компанией.',NULL,'@istampa','+998974495559','www.stampa.uz','+998974495559','undefined','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/rt/dr/vj/a5fcb6aa-c9fb-40a6-a0e8-949e39132884.png',0.00,NULL,NULL,'2025-08-04 16:31:35','2025-08-04 16:31:35'),(31,'ORANGE TEXTILE PROFI','ORANGE TEXTILE',NULL,'orangetextileinfo@gmail.com',NULL,'1','Узбекистан',0.00,1,'3','2009','member','$2y$10$oKkq47qAhmG5IS7EteSqe.Y5xcMskkLXq/42DH/U7mrYCiXOwPYdq','Уважаемый \nКомпания ООО «ORANGE TEXTILE PROFI» рада предложить