bc-4a24-a2c4-796a64bd68dd.png',0.00,NULL,NULL,'2025-08-04 16:31:38','2025-08-04 16:31:38'),(36,'Sultana Lyuks Biznes','SLB DENIM',NULL,'sultana.ilyaich@mega-biznes.uz',NULL,'1','Узбекистан',0.00,1,'3','2007','member','$2y$10$9ngKyw5zD4lg.Ji1iYBxqOfJNJG1xH5Em7cdhwzLvBNooOhKiNaEy','SLB Denim — это современная фабрика по производству и экспорту премиальной джинсовой одежды. Мы работаем в этой сфере более 5 лет, создавая качественную и стильную продукцию, которая отвечает самым высоким стандартам. Наша компания сочетает современные технологии с традиционным мастерством, чтобы предлагать клиентам джинсы, в которых сочетаются комфорт, долговечность и стиль.\n\nМы гордимся тем, что сотрудничаем с крупными брендами, такими как LİME, Mark Formelle, Familiya, OffPrice, Melon Fashion Group, Krapiva, Keanu, Batik, Vatonya, Vulpes. Это подтверждает наш высокий уровень качества и профессионализма.\n\nМиссия и ценности\n\nНаша цель — создавать джинсовую одежду, которая подчеркивает индивидуальность наших клиентов. Мы придерживаемся принципов:\n	•	Высокое качество – тщательный контроль на каждом этапе производства.\n	•	Инновации – использование передовых технологий в обработке тканей и пошиве.\n	•	Гибкость – возможность кастомизации моделей под запросы клиентов.\n	•	Надежность – долгосрочное сотрудничество с ведущими брендами.\n\nПроизводственные мощности\n\nМы располагаем современными производственными мощностями, которые позволяют нам выпускать продукцию в больших объемах:\n	•	Общая площадь – 50 000 м²\n	•	Цех стирки – 10 000 м²\n	•	Головной офис – 4 700 м²\n	•	Производственная линия – 1 000 м²\n\nПроизводственный процесс\n\nНаше производство включает несколько ключевых этапов:\n	1.	Моделирование и дизайн – команда дизайнеров разрабатывает новые модели, подбирает ткани и создает образцы.\n	2.	Раскрой ткани – высокоточные машины и опытные специалисты обеспечивают точность выкроек.\n	3.	Швейный цех – организован по бригадному принципу, что позволяет эффективно управлять процессом. Средний выпуск – 1 800 изделий в день.\n	4.	Стирка и обработка – используем современные технологии для придания джинсам уникального вида и долговечности.\n	5.	Контроль качества и упаковка – проверяем каждое изделие перед отправкой клиенту.\n\nПроизводственные объемы\n	•	1 день – 1 800 изделий\n	•	1 месяц – 45 000 изделий\n	•	1 год – 540 000 изделий\n\nМы гордимся тем, что создаем джинсовую одежду, которая соответствует мировым стандартам. Наши клиенты ценят нас за стабильное качество, надежность и индивидуальный подход.\n\nКонтакты\n	•	Телефон: +998 (91) 778-78-28\n	•	Email: sultana.ilyaich@mega-biznes.uz\n\nSLB Denim — это качество, которому доверяют крупнейшие бренды. Мы открыты для новых партнерств и всегда готовы предложить клиентам лучшие решения в сфере джинсовой моды.',NULL,'t.me/+998917787828','+998 91 778 78 28',NULL,'+998 91 778 78 28','$250.000-$1.000.000','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/zy/5k/yu/2416e629-364e-409f-af8f-eae6583526d0.jpg',0.00,NULL,NULL,'2025-08-04 16:31:38','2025-08-04 16:31:38'),(37,'ИП ООО Deniz Teks','DNZ',NULL,'info@denizteks.uz',NULL,'1','Узбекистан',0.00,1,'3','2022','member','$2y$10$2vpdvtqdrhnRcbZs7SpvLek0nXS888KzhicooTsts4XGlWUkzB6nu','ИП ООО «DENIZ TEKS», основанная в 2022 году, представляет собой молодую и амбициозную компанию, специализирующуюся на производстве швейных изделий, и входит в состав группы компаний «ZELAL TEKSTIL».\n\n«DENIZ TEKS» представляет собой одну из немногих швейных фабрик в Узбекистане, где производственные технологии объединили лучшие традиции древнего трикотажного искусства с передовыми достижениями современной техники.\n\nНа сегодняшний день компания производит широкий ассортимент одежды для всей семьи и экспортирует свою продукцию в страны Европейского союза, Турции, России и СНГ.\n\nНаша команда профессионалов тщательно следит за постоянным обновлением ассортимента, разработкой новых моделей и технологий, а также информированием наших клиентов о появлении новинок. Сотрудники проходят комплексное обучение, совершенствуют свои навыки и знания, участвуют в специальных курсах и тренингах, чтобы быть в шаге с современными тенденциями.\n\nЦелью нашей компании заключается в постоянном развитии и повышении качества продукции благодаря внедрению инновационных технологий. Наш девиз - сделать мир более совершенным.',NULL,'+998935011202','+998935011202','www.denizteks.uz','+998935011202','5','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/kp/zf/uw/4084b247-708c-4711-81df-5408f9249843.jpg',0.00,NULL,NULL,'2025-08-04 16:31:38','2025-08-04 16:31:38'),(38,'ИП ООО Zelal Tekstil','Zelal Tekstil',NULL,'info@zelaltekstil.uz',NULL,'1','Узбекистан',0.00,1,'4','2016','member','$2y$10$fPnue133seiZbE6OGHMvm.7aGiKerm0TvW/LV8bAzjMH5LINUCr02','Фабрика \"ZELAL TEKSTIL\" - одна из лидирующих текстильных компаний в Узбекистане.   Производственный комплекс расположен на 124 тыс. кв.м., оснащен самым современным оборудованием для производства и отделки трикотажного полотна, благодаря чему фабрика может выпускать 70 000 кг трикотажного полотна в день. \"ZELAL TEKSTIL\" по составу оборудования, технологическим операциям и видам обрабатываемого полотна проектировалась индивидуально.Фабрика имеет собственную лабораторию, производственные и складские комплексы, медицинский пункт для оказания первой помощи для работников фабрики, административное здание, в котором находится, выставочный зал для готовых образцов полотен, отдел контроля по качеству готовой продукции. Ассортимент выпускаемой продукции состоит из кулирной глади, рибаны, кашкорсе, интерлока, пике, футера, вискозы, махры, велюра.',NULL,'+998935011202','+998 93 501 12 02','www.zelaltekstil.uz','+998 93 501 12 02','undefined','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/ba/07/8x/e8302be2-22c0-4565-951a-b4dce313d217.jpg',0.00,NULL,NULL,'2025-08-04 16:31:38','2025-08-04 16:31:38'),(39,'Кушон Текс','Бизнес',NULL,'kushonteksmchj@mail.ru',NULL,'1','Узбекистан',5.00