цены: наши расценки позволяют вам получать максимальную прибыль от продажи готовой продукции.\n- Полный цикл производства: от разработки дизайна до упаковки готового изделия – мы берем на себя все этапы работы.\n Услуги, которые мы предлагаем:\n- Пошив женской, мужской и детской одежды.\n- Разработка уникальных моделей и коллекций.\n- Производство малых и средних серий.\n- Индивидуальные заказы для частных клиентов.\n- Обслуживание корпоративных клиентов.\nМы уверены, что наше сотрудничество будет успешным и принесет обеим сторонам ощутимую выгоду. Для получения дополнительной информации и обсуждения условий сотрудничества, пожалуйста, свяжитесь с нами по телефону или электронной почте, указанным ниже.\nКонтактная информация:\nАдрес: 350020, Краснодарский край, Краснодар, Центральный округ, улица Коммунаров, 268В, округ, 3й этаж, офис 302, вход со стороны Валберис\nТелефон: +7 999 4112288\nEmail: info@abenteks.ru\nСайт: https://abenteks.ru\nTelegram: https://t.me/abentex\nVK: https://vk.com/wall-214475368_12?ysclid=m4ydmcbz81870572847\nС уважением,\nШвейный цех Abentex\n',NULL,'abentex','+79994112288','https://abenteks.ru','+79994112288','3','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:33:13','2025-08-04 16:33:13'),(644,'ABM Anlagenbau & Maschinentechnik GmbH','ABM TECHNIK',NULL,'rd@abm-technik.de',NULL,'3','Узбекистан',0.00,0,'1','2011','member','$2y$10$/sP6qWR8/M.ZF4Da0iWEauxC4dRi3VB.qR3uTVQsDwW5zwy7TyD1q','Поставка перекиси водорода',NULL,'+998974032223','+998974032223','www.abm-technik.de','+998974032223','6','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:33:14','2025-08-04 16:33:14'),(645,'Abror Corp','Abror Test',NULL,'5uY12jzSGL@example.com',NULL,'1','Узбекистан',0.00,0,'1','2025','member','$2y$10$z6XZmUm7ScoNkO0w9U68Me.WUcLiVTcML/D7nUW13TnMWOV4UFUhq','Test',NULL,NULL,NULL,NULL,NULL,'No indicated','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:33:14','2025-08-04 16:33:14'),(646,'A&B Textile Collection','A&B Textile Collection',NULL,'beki2011@inbox.ru',NULL,'1','Узбекистан',0.00,1,'3','2020','member','$2y$10$gRiAipN4ICPK1D5e71t0KOEir9Kft9I/s4ZpIxKl4EiGhlEoLVt2G','Компания «A&В Textile Collection» — полный цикл производства одежды и тканей\nМы — фабрика которая закупает полотно у лучших фабрик Узбекистана! С 2020 года мы работаем в Узбекистане, город Гулистан — одном из промышленных центров страны. Современное оборудование и профессиональная команда позволяют нам гарантировать высокое качество на всех этапах.\nНаши ключевые преимущества:\n- Минимальная партия на пошив — от 500 единиц изделий, что делает возможным запуск небольших тестовых заказов.\n- Предоплата 50⁄50 — удобная система оплаты: 50% при заключении договора и 50% перед отправкой продукции.\n- Скорость работы — производство трикотажного полотна занимает 20−30 дней, после чего изделия сразу поступают в пошив.\n- Гибкость процессов — на фабрике работает 10−15 операционных потоков, что позволяет быстро адаптироваться к требованиям клиентов.\n- Контроль качества — внедрены шесть этапов проверок, обеспечивающих соответствие продукции стандартам ISO и ГОСТ.\n- Прозрачность работы — соблюдение сроков и условий строго по договору.\nПроизводственные мощности:\n-Трикотажное полотно можем закупать — до 1000 тонн ежемесячно.\n- Пошив одежды — до 200 000 изделий первого слоя и 200 000 изделий второго слоя в месяц.\nТрикотажные полотна на заказ:\nНам производят широкий ассортимент тканей на оборудовании от ведущих производителей (Mayyer, Mario Crosta, Dilmenler и другие). Используют сертифицированные материалы (OEKO-TEX STANDARD 100).\nАссортимент включает:\n- Кулирная гладь — 100% хлопок, вискоза, смесовые варианты с эластаном, плотность от 120 до 300 г/м².\n- Футер — двух- и трёхнитка с начёсом и без, плотность от 170 до 500 г/м².\n- Интерлок — с лайкрой, трикотаж муслин, даблфейс, ребристый, плотность от 170 до 330 г/м².\n- Рибана и кашкорсе — с эластаном, трансферная, плотность от 170 до 450 г/м².\n- Пике — даблфейс, американка, плотность от 170 до 330 г/м².\n- Футер трёхнитка — плотность от 260 до 500 г/м², с начёсом и без.                             И так далее:\nЭтапы контроля:\n1. Проверка качества изделия.\n2. Контроль параметров полотна.\n3. Проверка крашения на стойкость и соответствие цвета.\n4. Контроль параметров на стадии пошива.\n5. Финальная проверка и упаковка.\nУсловия сотрудничества:\nМы предлагаем минимальные сроки изготовления \nОбязательно подпишитесь на наш Telegram-канал!\nМы показываем отшитые образцы.\nРассказываем, за счет чего получаем качество отшитых изделий.\nОтвечаем на вопросы и консультируем.\n\nСсылка на канал находится в разделе «Контакты» — сайт.',NULL,'t.me/+Elegantfashionista','+998 97 109 91 99','https://t.me/Elegantfashionista','+998 95 885 91 99','Не указано','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/hs/ze/s6/a698f908-f320-44fa-9f9a-f1b589fdfb39.jpg',0.00,NULL,NULL,'2025-08-04 16:33:14','2025-08-04 16:33:14'),(647,'ActiveCloud','ActiveCloud',NULL,'u_kalanov@mail.ru',NULL,'7',NULL,0.00,0,'0','','member','$2y$10$gPZupvbciBNAhNkdMTuByu0gfDJGk.VeiSn2sRm.fE4lL4MjpC4A6','Доменные имена, хостинг',NULL,NULL,'1509040','active.uz',NULL,'','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:33:15','2025-08-04 16:33:15'),(648,'Ada seven textile','Ada7',NULL,'dh@ada7.group',NULL,'1','Узбекистан',0.00,1,'3','2022','member','$2y$10$4LfLlmqt23mpaSI.rILYbO1yxG.Dx9se7yNR39AYMmd62Ac5PU3f2','Производитель трикотажных изделий , швейный цех на 6 потоков (210 швей). Производитель трикотажных полотен, вязальный цех ( 24 круго-вязальные машины), красильный цех на 25 тонн в сутки. Ротационная печать полотна (пигмент)',NULL,'+79100825574','+79100825574',NULL,'+79100825574','7','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/oa/5v/38/55de6c38-7c52-47be-8ade-680ce29b44f7.jpg',0.00,NULL,NULL,'2025-08-04 16:33:15','2025-08-04 16:33:15'),(649,'Adil textil','Trend',NULL,'k03APypBs5@example.com',NULL,'1','Узбекистан',