бекистан',0.00,1,'3','2019','member','$2y$10$3qpRBf0uBUokasQKq1oyFeg02LBXsdzYHanN9kW.w622cSK5RZDPK','',NULL,'@Oblokul0v','+998906570502','www.prodenim.uz','+998906570502','','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/0a/iv/gu/c37bbff2-2cc9-4720-9b1e-46788b5c5a37.jpg',0.00,NULL,NULL,'2025-08-04 16:33:15','2025-08-04 16:33:15'),(655,'AGROEL/СПАНБОНД','СПАНЭЛ',NULL,'agroel_uzb@mail.ru',NULL,'3','Узбекистан',0.00,0,'3','2006','member','$2y$10$U9IKcCQgDjetbIacVnqBfebqHn79XGPJBV9aRBpr4BFpdDwGnTFmC','Компания \"АгроЭл\", является эксклюзивным, и единственным официальным партнером Завода \"Эластик\" Татарстан, в Узбекистане и занимается крупно-оптовыми поставками нетканого полипропиленого Агроволокна СПАНБОНДА для сельского хозяйства, строительства, ландшафтного дизайна, садоводческих питомников и текстильной промышленности.',NULL,NULL,'+998909212621','https://agroeluzb.business.site/',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/k0/u6/fl/1e9e9846-e6a9-4b8f-93f7-1366a4bc58ef.jpg',0.00,NULL,NULL,'2025-08-04 16:33:16','2025-08-04 16:33:16'),(656,'AGRO UNIVERSAL TEX SAVDO','',NULL,'agro-universal-ts@mail.ru',NULL,'7',NULL,0.00,0,'0','','member','$2y$10$lMKxmtA9JLderasLpq2MG.Diub3zjblEUQQQqJDmM50FJSf/bF1DK','Импорт каустической соды из Ирана',NULL,NULL,'+998946752612',NULL,NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/e5/31/cq/7a516863-b3ae-436b-9def-f61addfb2a06.jpg',0.00,NULL,NULL,'2025-08-04 16:33:17','2025-08-04 16:33:17'),(657,'AHMAD TEX GROUP','A-TEX',NULL,'info@atex.uz',NULL,'1','Узбекистан',0.00,1,'3','2019','member','$2y$10$wTE53InBZlZW1J6BDP2.L.RIgIN5lxYzHLqeZCX1FFBuX/7rND9jO','Фабрика Ahmad-Tex-Group — это динамично развивающаяся текстильная компания в Узбекистане, специализирующаяся на производстве трикотажного полотна и готовой трикотажной продукции. Благодаря современному оборудованию и высококвалифицированному персоналу фабрика способна удовлетворить запросы крупных заказчиков на международном рынке.\n2. Производственные мощности и потенциал\nAhmad-Tex-Group располагает мощной производственной базой с возможностью производства более 3 300 тонн трикотажного полотна в год. Фабрика предлагает полный цикл услуг от выбора и обработки сырья до выпуска готовой продукции, включая различные виды обработки и окрашивания тканей. Производственные мощности позволяют работать с хлопком, синтетическими волокнами, а также смешанными материалами, что открывает возможности для разнообразных трикотажных изделий, таких как футболки, худи, спортивная одежда и трикотажные аксессуары.\n3. Линейка продукции\nОсновные продуктовые линии включают:\n • Хлопковый трикотаж: натуральный, мягкий и дышащий, доступен в однотонных цветах в различных оттенках.\n• Поликоттон (смесь полиэстера и хлопка): прочный, устойчивый к износу и долговечный материал. Доступен в различных цветах, включая пастельные и насыщенные.\n • Готовая одежда: базовые футболки, спортивные костюмы, повседневная и специализированная одежда (например, униформа).\nФабрика ориентирована на крупные заказы и экспорт продукции на международные рынки, что позволяет ей быть конкурентоспособной и обеспечивать высокие объемы выпуска.\n4. Производственный процесс и контроль качества\nПроизводственный процесс на фабрике строго контролируется на каждом этапе:\n 1. Выбор и подготовка сырья: закупка сырья у проверенных производителей.\n 2. Ткачество и вязание тканей: используются современные автоматизированные машины.\n 3. Окрашивание и финишная обработка: строгое соблюдение стандартов и использование экологически чистых технологий.\n 4. Контроль качества: продукция сертифицирована по международным стандартам что гарантирует отсутствие вредных веществ в тканях.\n5. Упаковка и подготовка к отправке.\n5.Сроки производства зависят от объема заказа:\n • Малые заказы: (до 500 кг) 2-3 недели.\n • Средние заказы: (до 5000 кг) 3-5 недель.\n • Крупные заказы: (от 5000 кг) 5-8 недель.\nДаты поставки рассчитываются в зависимости от объема и местоположения клиента, обычно от 10 до 20 рабочих дней после завершения производства\n6. Целевые рынки и источники дохода\nОсновными целевыми рынками для Ahmad-Tex-Group являются страны Европы и Азии, где высоко ценится качество трикотажа и трикотажной одежды. Потенциальные источники дохода:\n • Оптовые поставки трикотажных тканей производителям одежды.\n • Производство готовой одежды на заказ для международных брендов и сетевых ритейлеров.\n • Экспортные контракты с крупными дистрибьюторами и оптовыми компаниями.\n6. Условия сотрудничества и доставка\nAhmad-Tex-Group предлагает гибкие условия сотрудничества:\n • Минимальные объемы заказа: обсуждаются индивидуально в зависимости от специфики клиента.\n • Оплата и условия: 70% предоплата, остаток — по завершении заказа, перед отгрузкой\n • Доставка: организована с учетом требований заказчика, возможна доставка по всему миру с использованием проверенных логистических партнеров.\n7. Заключение\nAhmad-Tex-Group — это надежный партнер для крупных заказчиков в сфере производства трикотажных тканей и готовой одежды. Компания стремится к устойчивому развитию, используя экологически чистые материалы и соблюдая высокие стандарты качества.\nМы открыты для долгосрочного и взаимовыгодного сотрудничества с партнерами, заинтересованными в высококачественной трикотажной продукции и уверены, что наше сотрудничество будет плодотворным и взаимовыгодным. Наша компания готова обсудить любые детали вашего заказа и предложить индивидуальные решения, учитывающие ваши потребности.\n',NULL,'+998937800803','+998937800803','https://atex.uz/','+998937800803','4','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:33:17','2025-08-04 16:33:17'),(658,'AHSAN','AHSAN',NULL,'kamiloof@gmail.com',NULL,'1','Узбекистан',0.00,1,'1','2021','member','$2y$10$akqO.T8QGzh8vw.h0lbvEO6FYsoFy/FkkqZVkrwlDq3AKoItuV6vi','Добро пожаловать в мир AHSAN Textile!Наша молодая фабрика уже успела зарекомендовать себя среди более ч