ьная команда, обладающая более чем 15-летним опытом и высокой квалификацией, внося вклад в развитие предприятия, применяя передовую практику в области производства и инноваций, и обеспечивая соответствие продукции мировым стандартам качества.\r\nВ производственный процесс также вовлечены зарубежные дизайнеры, которые регулярно обновляют ассортимент джинсовой продукции, вдохновляясь исторически укоренившимся синим цветом куполов и архитектурных узоров Бухары, который очень хорошо сочетается с цветом индиго.\r\nКомпания использует самое современное оборудование и технологии из Германии, США, Бельгии, Италии, Швейцарии и Турции.\r\n\r\nПРОДУКЦИЯ:\r\nДжинсовая ткань\r\nГотовые джинсовые изделия (в том числе по принципу WHITE LABEL)\r\nСТМ\r\n\r\n\r\nСертификаты соответствия: ISO 45001:2018; ISO 9001:2015; ISO 14001:2015; OEKOTEX STANDARD 100: 19.HUZ.84711 HOHENSTEIN HTTI; OEKOTEX STANDARD 100: 20.HUZ.11571 HOHENSTEIN HTTI; OEKOTEX STANDARD 100: 20.HUZ.11573 HOHENSTEIN HTTI',NULL,'@shamshod01','+998934566546','bctdenim.com','+998934566546','','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/pu/fh/xs/4f29e0fb-7580-4f87-96bd-2f7783488af7.jpg',0.00,NULL,NULL,'2025-08-04 16:34:00','2025-08-04 16:34:00'),(820,'BUTTON FASHION DESIGN','UZBEK TUGMASI',NULL,'buttons_namangan@mail.ru',NULL,'7',NULL,0.00,0,'0','','member','$2y$10$B0WJ5AsxJxtWEhaf7sz4duP3ga/43fWuXHgo626kt55zCgY211vK.','ПРОИЗВОДСТВО ПУГОВИЦ ИЗ ПОЛИЭФИРНОЙ СМОЛЫ ВЫСОКОГО КАЧЕСТВА БЕЗ НАПОЛНИТЕЛЕЙ.  \r\n\r\nКомпания «Button Fashion Design» является лидирующей производственной компанией, которая специализируется на производстве пуговиц из полиэфирной смолы для детской, женской, мужской и спецодежды. \r\nКомпания, расположена в городе Наманган. Несмотря на свою молодость, компания успела завоевать признание и любовь заказчиков – трикотажных и швейных фабрик Узбекистана.\r\nМы стараемся оптимально решать поставленные задачи, обеспечивая выпуск качественной продукции. \r\nПри разработке моделей  учитываем не только новые направления моды, но и удобство, практичность при носке изделий. Продукция изготовлена из высококачественных материалов, отличается удивительным дизайном, выполненным с учетом модных тенденций, способная удовлетворить различные вкусы потребителей.\r\nПроизводственные цеха компании оснащены новейшим оборудованием производства Италии. Автоматизированное оборудование, используемое на различных этапах производства, обеспечивает высокую производительность при оптимальном использовании сырья, что в свою очередь сказывается на сравнительно невысокой стоимости продукции. Сырье 100% импортное, производство без наполнителей, продукция прошла тесты Российских и Итальянских лабораторий по влиянию продукции на кожу детей.\r\nДля удобства заказчикам переговоры ведет коммерческий директор, который будет вести консультацию по всем интересующим Вас вопросам, а также проконтролировать процесс выполнение Вашего заказа в указанные сроки и в соответствии с Вашими потребностями и предпочтениями.\r\nСуществует гибкая система скидок для оптовиков, фабрик с заказом в больших количествах. Форма оплаты по Вашему усмотрению.\r\nЗабудьте про вложений на закупку крупных партий пуговиц! Закажите нужное количество, включая свой вклад в развитие отечественного производства!   ',NULL,NULL,'+998939460016','https://www.facebook.com/ilamax',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/ne/ou/jh/dc75c2c0-327e-4119-94bb-bd759cc05767.jpg',0.00,NULL,NULL,'2025-08-04 16:34:00','2025-08-04 16:34:00'),(821,'Buxara Textile Luxe','BTL',NULL,'buxara-textile-luxe@mail.ru',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$d84jlWP34b.SJOwDvW9KCOiqi5dS0TukhA.MiTr1if60c8IecAfQi','Proizvodstvo netkanogo polotno i vati prima',NULL,NULL,'+998907443333',NULL,NULL,'','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:34:00','2025-08-04 16:34:00'),(822,'Buxoro komfort tekstil','Buxoro komfort tekstil',NULL,'buxorokomfort@mail.ru',NULL,'2','Узбекистан',0.00,