 turli mamlakatlardagi mijozlar bilan yaqin aloqa oʻrnatish imkoniyatiga ega boʻldi. Yarmarkada duch kelgan talab bilan xalqaro maydonga yo\'l ochdilar. Bugungi kunda ishlab chiqarish va eksport to\'liq sur\'atda davom etmoqda va bozorga yuqori sifatli mahsulotlarni taklif qilmoqda.\n\nDMS Technology Makina сделала свой первый шаг в 2010 году в небольшом магазине двух братьев, которые проработали в отрасли много лет и видели недостатки в использовании и технических областях существующих торговых систем и имели страсть к инновациям. промышленность.\n\nНачались работы над первой серийной филетировочной машиной, и после 8 месяцев полевых испытаний она была готова к продаже в 2012 году. Таким образом, был увеличен ассортимент продукции и продолжено производство автоматов. В этот период к команде присоединились зрелые, новые товарищи по команде, а команда и производственная зона расширились. В 2017 году он получил бренд «DMS». В 2018 году она представила свои машины на международном рынке на 26-й Международной выставке швейных машин, проходившей в Стамбуле, и получила возможность установить тесный контакт с клиентами из разных стран. Благодаря спросу, который они встретили на ярмарке, они открыли себе путь на международную арену. Сегодня производство и экспорт продолжаются полным ходом и предлагают рынку продукцию высокого качества.',NULL,'+998905549966','+998905549966','Dmsteknoloji.com','+998905549966','3','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/ok/b8/q9/4a7aff5a-e261-41ca-992f-40a16dfdbf6e.jpg',0.00,NULL,NULL,'2025-08-04 16:34:29','2025-08-04 16:34:29'),(904,'DMSTEKNOLOJI ','Dmsteknoloji ',NULL,'dms.uzbekistan@gmail.com',NULL,'4','Узбекистан',0.00,1,'1','2010','member','$2y$10$TE9PniCmtU6Q8Kf5.lSQBe3DDDMf0ZzIj/OjbHRdA5qZ8hm9841cS','DMS TEKNOLOJI | AUTOMATIC SEWING MACHINE\nКомпания в области робототехники\nАвтоматизация текстильной промышленности как\nсемейство технологий DMS\nМы гордимся тем что обслуживаем вас в наших\nсистемах\nТелефон 