ного оборудования Elna и Metalnova, вязального оборудования SilverReed, ткацких станков шведской фирмы Glimakra, фирмы Organ - ведущего производителя игл для бытовых швейных машин и промышленного оборудования и эксклюзивным поставщиком ножниц Premax. Компания ЭЛФОРТ предлагает широкий спектр продукции: Швейные и вышивальные машины Ткацкие станки Вязальные машины Паро-гладильное оборудование (гладильные станции, доски, утюги с парогенератором и гладильные прессы) Аксессуары и сопутствующие товары (иглы, лапки, ножницы, столы, программное обеспечение и многое другое) Манекены Шкатулки различных форм и размеров Постоянным покупателям мы оказываем поддержку в виде обучений и консультаций. Для функционального обслуживания техники, имеются авторизованные сервисные центры в различных городах России, которые исполняют гарантийные, послегарантийные и профилактические работы в минимальные сроки. Компания ЭЛФОРТ успешно работает в сфере развития дилерских отношений и предлагает выгодные цены для оптовых покупателей. Мы всегда рады вашим заказам и предложениям о сотрудничестве!',NULL,'@elfort_city','+998901151199','elfort.uz',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/vu/c2/74/9b8bcc2d-9f84-47e9-b2e4-5beb3c5ae8b5.jpg',0.00,NULL,NULL,'2025-08-04 16:34:38','2025-08-04 16:34:38'),(938,'ELIFTEKS PARTNERS','',NULL,'bahromjon.holikov@gmail.com',NULL,'1','Узбекистан',0.00,1,'1','2023','member','$2y$10$9/IN0/GCHQARjUoXlPx5LeO0tNlbn7Os5MqnGiEa3yC6Kg/rqf4aK','',NULL,NULL,'+998990880193',NULL,NULL,'','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:34:38','2025-08-04 16:34:38'),(939,'Ellada Ms tekstil ','ELLADA MS',NULL,'mustafaseniz40@gmail.com',NULL,'1','Узбекистан',0.00,1,'3','2019','member','$2y$10$Zx9DSofW0.ZgTK9/i4WJLOp.G83zR55SNj20fBkvjbn8fdw3xW8pG','Трикотажные фабрика ',NULL,'+998938065888','+998938065888',NULL,'+998938065888','1','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:34:38','2025-08-04 16:34:38'),(940,