отажа, производимые нашим предприятием, экспортируются в зарубежные страны.',NULL,'Sewinguzbekistan','+998972274330','https://t.me/Sewingfactoryuzbekistan',NULL,'undefined','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/8v/z3/ct/2bd69e7f-5bf8-493f-92bc-1c163ec46651.jpg',0.00,NULL,NULL,'2025-08-04 16:34:51','2025-08-04 16:34:51'),(990,'FOREST YARN LLC','FOREST YARN',NULL,'musomustaf@gmail.com',NULL,'1','Узбекистан',0.00,1,'1','2021','member','$2y$10$3fsYFF37ZwhjlFtkUL2enOebfsH/NN9F5OqYY/EFScLH1HchYHCiS','Dyed cotton yarn. Крашенная х/б пряжа.',NULL,'@forestyarn','+998999925002','forestcolor.uz','+998999925002','4','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/z6/e8/vn/c954b43c-e42e-42e3-994a-90c1da380e2f.jpg',0.00,NULL,NULL,'2025-08-04 16:34:52','2025-08-04 16:34:52'),(991,'FORWARD TEXTILE INC','FORWARD ',NULL,'odiljon6660@gmail.com',NULL,'1','Узбекистан',0.00,1,'2','2016','member','$2y$10$cZU4uDKE6hKz4z4ZrFB9UOu1sUAD.w2VfrapTvGaTHDeQEa8Q8eBG','Швейный Цех \"Forward Textile\"\n\nМы шьем с душой с 2016 года!\n\nИщете идеальную одежду на заказ? Наши опытные специалисты и дизайнеры создают одежду, которая подчеркнет вашу индивидуальность и стиль. В нашем ассортименте:\n\n- Футболки\n- ⁠Трикотаж\n- ⁠Мужская одежда \n- ⁠Детская одежда \n- Спортивная одежда\n- ⁠Женские халаты \n- И многое другое!\n\nВ \"Forward Textile\" мы гарантируем высокое качество и идеальную посадку. Доверьте нам создание вашей уникальной одежды!\n\nМы принимаем заказы в больших объемах от частных клиентов и корпоративных заказчиков, работаем с различными компаниями по созданию товаров и предоставлению швейных и вязальных услуг. Также предлагаем экспорт готовой продукции.\n\nПриходите к нам и создайте свой идеальный образ вместе с нами!\n\nШвейный Цех \"Forward Textile\" – Ваша идеальная одежда на заказ!',NULL,' +12246515018','+998954444383',NULL,'+12246515018','2','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/wd/ev/va/9bb05bf1-