брика LE&LO текстиль гарантирует исполнения всех заказов в срок и качественно.Мы готовы с Вами на тесное и долгосрочное сотрудничество.',NULL,'t.me/+998902007679','+998 90 200 76 79','@nargizakurbanova1980','+998 90 200 76 79','$6.000.000-$15.000.000','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/xn/zd/h1/2e7d501c-da5d-4b63-bc32-4c97d8902c83.jpg',0.00,NULL,NULL,'2025-08-04 16:35:38','2025-08-04 16:35:38'),(1181,'LEONIS','',NULL,'info@leonis.uz',NULL,'2','Узбекистан',0.00,1,'0','','member','$2y$10$aH.iiWJnnpoLKjTP8u7ag.gG552qHsBcw781gDLZ6rTpTLS2WiCBC','омпания “LEONIS” активно развивающаяся компания специализирующаяся на производстве и оптовой продаже хозтоваров, товаров повседневного спроса и товаров бытовой химии. Одной из основных направлений деятельности компании является снабжение продукцией хозяйственного и бытового назначения любых предприятий и организаций (HoReCa). Мы также очень рады предложить Вам бытовую химию в широком ассортименте, для всех видов поверхностей и любого целевого назначения, как местных производителей, так и импортных производителей. ',NULL,'@LEONIS_LLC','+998931230075','leonis.uz',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/lm/7q/mn/6f0afa90-58c0-4781-a5a4-344acf91a3e8.jpg',0.00,NULL,NULL,'2025-08-04 16:35:38','2025-08-04 16:35:38'),(1182,'Leteks','',NULL,'atabaevbakhadir123@gmail.com',NULL,'1','Узбекистан',0.00,1,'1','2023','member','$2y$10$73cytMNI81gTO7XIl7v0DuTW9nxzHP4bYqpiGBMaqRlZgzH3zPWaa','Turli hil trikataj mahsulotlar ishlab chiqaramiz va buyurtmalarni qabul qilamiz.\n\nМы производим различные трикотажные изделия и принимаем заказы.\n\nWe produce various knitted products and accept orders.',NULL,'+79165746458','+79165746458',NULL,'+79165746458','2','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:35:39','2025-08-04 16:35:39'),(1183,'LIANYUNGANG YIMING INTERNATIONAL FREIGHT  FORWARDING CO., LTD','',NULL,'O417zvz14H@example.com',NULL,'4','КНР',0.00,1,'1','',