мается производством готовой трикотажной и ткацкой продукции в самом широком ассортименте, небольшую подборку которой вы можете увидеть по ссылке\n на нашем сайте www.yustex.uz\nМы работаем длительное время с такими марками, как: «People in», «Letto», «Marmaletto», «Bau-bau», «Ocelot teco», «Artie», «Vulpes», «Bachetti», «ELIS», «Детский Мир» «Катафэ» и т.д.\n       Наша компания имеет:\n- отдел конструирование-моделирования, в котором высококвалифицированные специалисты могут создать лекала для всех видов трикотажных и ткацких изделий, в соответствии с требованиями заказчика. Оснащены оборудованием и программным обеспечением, как: «GERBER», «ACCUMARK», «GEMINI» «RECHPEASE».\n- профессиональное раскройное оборудование немецкого производства, каттэр системы Balmer с дополнительным автоматическим настилочным оборудованием турецкой фирмы Ozbilim.\n- самую передовую технологию турецкой компании SULFET позволяющую печатать одновременно до 12 цветов.\n- парк швейного оборудования из Японии более 550 единиц, а общий штат сотрудников более 1200 человек, 24 швейные линии, которые ежедневно выпускают от 25 до 35 тысяч готовых изделий, ежемесячный объем достигает 500-800 тысяч изделий.\n     На сегодняшний день для размещения заказа на наших производственных площадках минимальное количество на 1 артикул и цвет составляет – 1000-2000 единиц.    \nМинимальный объем заказа составляет от 5000-15000 единиц.\nВсе образцы после заключения договоренности и соглашения на расценку.\nДля просчета изделий просим отправить табель-мер , лекало в формате dfx rul  , граммаж  полотна , состав и качество заказа в размерной сетке.\nСрок изготовления под ключ  составляет в зависимости от количества изделий.\nВ надежде на скорую обратную связь и дальнейшее взаимовыгодное сотрудничество.\n \nКонтактный номер : +998 97 144 94 08 (тереграмм, вацап)',NULL,'t.me/+998977740990','+998977740990','www.yustex.uz','+998977740990','Не указано','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/rh/r0/nz/0aa2ef6b-ba81-429a-8dd0-c4cf9c3c6436.jpeg',0.00,NULL,NULL,'2025-08-04 16:35:43','2025-08-04 16:35:43'),(1200,'LLFC \"Osborn Textile\"','Mirelle',NULL,'infi@osborntextile.uz',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$Ew.pBrB3a3QlTdX9gkdQw.0q8EgE/1Te4K1jOIrfrstV9OLgfP8sW','LLFC  «Osborn Textile» has the technical and production capacity to meet customer demand for the supply of:\r\n- ring spinning and compact  dyed yarn from 100% cotton;\r\n- melange yarn made from 100% cotton and blended melange yarn of cotton / polyester; cotton / modal;\r\nThe range of the counts of yarns is from Ne 12 (Nm 20) to Ne 40 (Nm 68) with definite twist and several threads twisted.\r\n- dyed bamboo and modal yarn with the range of the counts  from Ne 16/1 (Nm 27/1) till Ne 50/1 (Nm 85/1);\r\n- blended raw and dyed yarn (polyester / cotton)\r\nIn addition, the company produces and offers for  realization  knitted fabrics and terry fabrics and also ready-made terry and velor products, marketed under the brand name «Mirelle» from 100% cotton and blended (40% cotton / 60% bamboo, 30% cotton / 70% bamboo): bathrobe,  kilts, bedsheet for bedroom, terry and velour  towels, terry and velour products.\r\nThe products are certified, it has good hygienic properties.',NULL,NULL,'+998711505682;+998711505683;+998711505684;+998711505685;+998711505686;','www.osborntextile.uz; www.mirelle.uz',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/cj/22/07/79c3631b-ccaa-4437-ab4f-d9a9dafafcca.jpg',0.00,NULL,NULL,'2025-08-04 16:35:43','2025-08-04 16:35:43'),(1201,'LMS MODE','',NULL,'info@lms-mode.com',NULL,'5','Германия',0.00,1,'1','2003','member','$2y$10$SBtUVK81TcT6ss3mvBwa4uKbrdFgY6vl9WRtvHJe/ymwWjigO8b6a','Маркетинг и организация экспорта в страны Европы',NULL,'AndreyUtochkin','+491758246353','lms-mode.com','+491758246353','2','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:35:44','2025-08-04 16:35:44'),(1202,'Logic Tex','',NULL,'abduhalilovaniluf