абайкальск в Россию. Мы можем предложить услуги ж/д консолидаций официально из Китая в Алматы, Ташкент и Улан-Батор. Все необходимые документы будут. Головной офис базируется в городе Шеньчжень, Китая. \r\nНаша компания может осуществить таможенные услуги, отслеживание грузов на всем пути следования, оформление необходимых документов, затамаживание сборных и личных грузов, обеспечение безопасности груза. Так же мы предоставляем нашим Клиентам услуги по экспортному таможенному оформлению и хранению грузов на нашем складе. \r\nМы готовы предложить Вам хороший сервис и конкурентно-способную цену на перевозку Ваших грузов. Если у Вас возникнут какие-либо вопросы, то мы готовы ответить на них. Мы стараемся подобрать оптимальный вариант для каждого Клиента. \r\nКитай-Алашанькоу (Достык) - Центральная Азия\r\nКитай-Маньчжурия (Забайкальск) -Россия /Беларусь / Европа\r\nКитай-Эрлянь (Замын-Ууд)',NULL,NULL,'+86 13820254751','www.nep-logistics.net',NULL,'','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:36:16','2025-08-04 16:36:16'),(1335,'Neptune Logistics Group','',NULL,'lulu@nep-logistics.com',NULL,'5','КНР',0.00,0,'3','2002','member','$2y$10$7eP9Ks/wTR9WHs9ry2xMY.1Bo3fOkTXpUJ1d1kvQvtqBQrpjHCMNG','Наша компания Neptune Logistics приносим вам большую помощь в областях перевозки грузов из Китая в СНГ и Европу. У нас тоже есть обратный поезд из Европы и СНГ в Китай. Работаем на рынке более 17 лет, есть большой опыт. Наше главное и преимущественное направление перевозки Китай--Россия, Казахстан, Узбекистан, Кыргызстан, Таджикистан, Туркмениста, Монголия и транзит через Китай в вышеуказанные страны. У нас разные транспорты: по жд,авто,авиа, и мультимадальные перевозки по жд+авто ,авто+авиа и т.д.  \r\nExpert in railway transportation from China to CIS countries, such as Russia, Belarus, Ukraine, Kazakhstan, Uzbekistan, Tajikistan, Kyrgyzstan, Mongolia，and also to Europe, such as Germany, Poland, Italy, France, Spain，Finland. We can send goods to Turkey, Azerbaijan too. Import from these countries to China we can also do it.',NULL,NULL,'+8613694242832','www.nep-logistics.com','+8613694242832','','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/8f/33/br/0389ea65-f072-46b5-ae7d-2714af946a3b.jpg',0.00,NULL,NULL,'2025-08-04 16:36:16','2025-08-04 16:36:16'),(1336,'NETWORK SOLUTION TRADE','NST',NULL,'networksolutiontrade@gmail.com',NULL,'6','Узбекистан',0.00,1,'1','2021','member','$2y$10$E/G.Fk4P4qgJmI6/DOOQ5eIGJ5oM1CEuRJS3Kbf/KjifVjVdtq7oy','Наша компания с гордостью представляет себя как производителя высококачественных трикотажных изделий — футболок, поло, пижам и детских боди. Мы успешно работаем в этой области уже более трёх лет, и за это время зарекомендовали себя как надёжный и ответственный партнёр.\n\nОднако наша специализация не ограничивается только трикотажем. Мы также специализируемся на пошиве классической мужской и женской одежды. Наш ассортимент включает в себя костюмы, брюки, пиджаки, юбки, платья, сорочки и блузы. Мы гордимся нашим мастерством и вниманием к деталям при создании каждого изделия, стремясь к идеальному качеству и стилю.\n\nМы всегда открыты к новым возможностям и готовы к переговорам о сотрудничестве. Если наше предложение привлекло ваше внимание, будем рады обсудить детали сотрудничества и найти наилучшие решения для вас и вашего бизнеса.',NULL,'networksolutiontrade','+998900500100','nsttrade.com','+998900500100','2','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/sy/b0/f4/256a5b6d-a1fe-4f22-8ad9-5a42b05065cc.jpg',0.00,NULL,NULL,'2025-08-04 16:36:16','2025-08-04 16:36:16'),(1337,'New Land','FARALI textile company',NULL,'newland.uzb@gmail.com',NULL,'2','Узбекистан',0.00,1,'3','2019','member','$2y$10$EqzYthxWx9ZoCd9p5oOJZeP5lWvu6n2UFcid7LGhcUOzX3LcmEDEW','Наши производственные мощности позволяют изготовить одежду любой сложности из лёгких и средних тканей (текстиль и трикотаж). Мы отшиваем: последние тенденции моды для девушек и женщин.',NULL,'@farali_tex