 на каждом производственном участке.\r\nНа первом этапе установлено оборудование для крашения пряжи объемом 5кг,100 кг,400 кг,600 кг,1200 кг, а также сушильная машина объемом 600 кг, мотальные станки для мягкой намотки 360 головок, для конечной намотки 360 головок, комплект лабораторного и вспомогательного оборудования соответствующее европейским стандартам.\r\nСтратегия развития предприятия нацелена на изготовление готовой текстильной продукции путем реализации проектов по дальнейшему увеличению производственных мощностей в отделочном производстве.\r\nНадеемся на долгосрочное и взаимовыгодное сотрудничество!',NULL,'Alexandra_sbim','+79254459136','www.sbim.uz','+79254459136','','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/ii/i0/du/80bf4dbb-7cbc-4059-9ddc-03c440eb556b.jpg',0.00,NULL,NULL,'2025-08-04 16:36:37','2025-08-04 16:36:37'),(1412,'OOO\"COHICE PRINT LOGO\"','',NULL,'kretov2001@mail.ru',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$O/MolN7G88lTkz1pATiGA.TIX1pCEN34AlHG1THtehQR.sIePeew.','Карусельная печать  разм. 100x80 см руч. 200x90 см трансферная печать.стикеры бирки.уф лакировка фольгирование.',NULL,NULL,'+998903567604',NULL,NULL,'','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:36:37','2025-08-04 16:36:37'),(1413,'OOO COTTON FASHION','TURAN KIMYA',NULL,'alishoh2007@mail.ru',NULL,'7',NULL,0.00,0,'0','','member','$2y$10$RqiGRhnb4jtCFJ3wXjFEQeZvUX2Pj3ECNIktpeRgojHs.CnQVQjfS','\"TURAN KIMYA\"\r\nКРАСИТЕЛИ, ПРИМЕНЯЕМЫЕ В ТЕКСТИЛЬНОМ ПРОИЗВОДСТВЕ',NULL,NULL,'+99893 501 61 71   +99890 122 32 92  +99871 269 26 31','turankimya.com',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/sq/i5/je/4b1871c5-efdf-4c1b-a924-1673dff2756b.jpg',0.00,NULL,NULL,'2025-08-04 16:36:38','2025-08-04 16:36:38'),(1414,'OOO Cotton World Tex','Текстиль для дома',NULL,'cottonworldtextile@gmail.com',NULL,'2','Узбекистан',0.00,1,'7','2007','member','$2y$10$JaqpYqEgYhxFMwn55ja.eOHqwZY62sOd1FDO9GYpvCDz.0HClYdM.','Компани