ские этапы в процессе производства текстильных изделий, начиная от процесса закройки до выпуска готовой продукции, производятся на территории самой компании, что также обеспечивает низкие цены конечных изделий. Также, на каждом этапе производства ведется строгий контроль качества. Забота о клиентах — для обеспечения удобства клиентам, для каждого из них предоставляется персональный менеджер, который будет вести консультацию по всем интересующим Вас вопросам, а также проконтролировать процесс выполнение Вашего заказа в указанные сроки и в соответствии с Вашими потребностями и предпочтениями. И самое главное, Компания «VERO MODA» имеет возможность производить продукцию под брендом компании клиента, тем самым обеспечив клиенту свой индивидуальный статус. Компания «VERO MODA» будет рада сотрудничеству с Вами и приглашает Вас на нашу фабрику для обсуждения индивидуальных условий.',NULL,NULL,'998909430108',NULL,NULL,'','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:37:11','2025-08-04 16:37:11'),(1527,'OOO \"Workly\"','Workly',NULL,'info@workly.io',NULL,'7','Узбекистан',0.00,0,'1','2012','member','$2y$10$9MhShEyITDs9b.XnQHeuvulhybrPAXauH1uxJDpahBhGoNXTAmM06','Система учета рабочего времени сотрудников текстильных предприятий. Компания занимается внедрение Программы для оптимизации расходов на заработную плату сотрудников. \r\nФункционал: \r\n1. Приход уход через турникеты\r\n2. Приход уход по оборудование с Face ID\r\n3. Расчет фактической заработной платы\r\n4. Расчет штрафов за опоздания\r\n5. Расчет сверхурочных часов\r\n6. Учет командировочных и отпусков\r\n7. Телеграм бот для сотрудников\r\nи многое другое.',NULL,'@worklyhr',NULL,'www.workly.io',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/z0/uo/wg/05be60e7-b77e-44ff-8fce-b960a40bdd91.jpg',0.00,NULL,NULL,'2025-08-04 16:37:11','2025-08-04 16:37:11'),(1528,'OOO XAN CHAPAN ','XNCH',NULL,'xanchapan@inbox.ru ',NULL,'6','Узбекистан',0.00,1,'1','2021','member','$2y$10$qpCH