ие клиента.     \r\nНа данный момент наше производство производит 1000 единиц продукции в день и готовы к увеличению производство. \r\n\r\nРады предложить вам продукцию нашего производство напрямую без посредников. OZMA всегда нацелена на долгосрочное сотрудничество и взаимовыгодные партнерские отношения.\r\n\r\nНаши ПАРТНЕРЫ это крупный, средний и мелкий бизнес. С нами активно сотрудничают координаторы совместных покупок.\r\n\r\nOZMA продает продукцию от 9000руб., при этом мы готовы поставлять те размеры которые Вам необходимы, у вас нет необходимости выкупать весь размерный ряд, это существенно экономит Ваши средства на закупки не ходовых у Вас размеров и увеличивает ВАШ оборот.\r\n\r\nМы доставим ваш заказ в любой уголок мира, осуществим подробную консультацию по товарам и поможем с выбором.\r\n\r\nНаш отдел продаж всегда на связи и готовы консультировать Вас по ассортименту, доставке, оплате и любым другим возникающим у Вас вопросам.\r\nДля оптовых покупателей мы предоставляем специальные условия сотрудничества. Мы готовы предложить выгодные цены и гибкую систему скидок.\r\n\r\nНаша компания OZMA гарантирует высокое качество продукции, своевременную доставку и индивидуальный подход к каждому клиенту.\r\n\r\nЕсли у вас возникли вопросы или вам нужна дополнительная информация, пожалуйста, свяжитесь с нами по указанным контактным данным. Мы будем рады сотрудничеству!',NULL,'@zakazozma',NULL,'https://ozmamarket.ru','+79057708529','','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/dd/0v/b9/407eca59-2187-4596-be4a-a281a058b058.jpeg',0.00,NULL,NULL,'2025-08-04 16:37:22','2025-08-04 16:37:22'),(1556,'PackMaster','uzBirka.uz',NULL,'packmaster2001@mail.ru',NULL,'7',NULL,0.00,0,'0','','member','$2y$10$pFRR6eby2Vf8PnrGMYaQ9OhgcmMAtGjpssXRHNkQrmAz2wWQjvFkO','Компания PACKMASTER это иными словами НОУ-ХАУ нашего времени , это лояльный подход к каждому клиенту , это экономия вашего времени , это идеи которым нет придела. Ваши идеи дизайна которые возмо