8979272705','undefined','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/wa/01/9y/ef96a86f-f3bb-4710-aed6-462f9a7e73c6.png',0.00,NULL,NULL,'2025-08-04 16:37:43','2025-08-04 16:37:43'),(1650,'Samarkand Euro Asia textile (cluster)','Lelit',NULL,'kh.isroilov@setextile.uz',NULL,'1','Узбекистан',0.00,1,'3','2015','member','$2y$10$IczOA71t9voEu91YnhuYVe3qx7kLgGXk4EqbXFxp2owHbOXb6QgQu','Текстильное предприятие 000 «Samarkand Euro Asia Textile» было основано в 2015 году и представляет собой уникальное предприятие, осуществляющее весь производственный цикл от выращивания тонковолокнистого хлопка до производства готовых текстильных изделий на собственных производственных мощностях.\n\nКомпания специализируется на производстве пряжи, тканей, сорочек и блузок, а так же комплектов постельного белья из натурального Хлопка.',NULL,'+998906030305','+998907431991','https://seatextile.uz/','+998906030305','4','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:37:44','2025-08-04 16:37:44'),(1651,'Sami textile','$',NULL,'odilhonsobitov@gmail.com',NULL,'6','Узбекистан',0.00,1,'1','2019','member','$2y$10$eFU.V9B7LnYruf1VQ7nHpuXZTFrgOmeG85uSlCPZMawfix5floKRe','$',NULL,'t.me/+@Astarhous','+998 99 009 99 83',NULL,'+998 99 009 99 83','Ko\'rsatilmagan','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/bm/ov/e7/136b1e65-3d74-4586-a67a-3ea28fa04059.jpg',0.00,NULL,NULL,'2025-08-04 16:37:45','2025-08-04 16:37:45'),(1652,'Sam-Negin LLC','SN GROUP',NULL,'info@sngroup.uz',NULL,'2','Узбекистан',0.00,1,'3','2003','member','$2y$10$8xQlQN/0f4NRLIHlu/OAYOEiq/80LDVkhpMVeUoyXs6mjW5jMHhjW','Производство ПЭТ волокна, синтепона, грязезащитных систем, ковриков, ковролина, паласов, клея ПВА и Латексного клея',NULL,'@jakhongir_abdulloev','+998904540000','sngroup.uz','+998981370420','','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/sm/gp/nm/62ccc13f-eb60-4451-aec6-3187f3a196f9.jpg',0.00,NULL,NULL,'2025-08-04 16:37:45','2025-08-04 16:37:45'),(1653,'SAMO','SAMO',NULL,'b.yusupov@samo.uz',NULL,'1','Узбекистан',0.00,1,'4','1996','member','$2y$10$48RV84PR6Hw.oq/JjXy/Nuih5KB25727wLH1JFegRICoR7zB9w2m6','Samo — Ваш надежный партнер в мире текстильной и швейной продукции! Компания имеет международные сертификаты, что позволяет ей  уверенно работать на всех рынках мира. Будьте  уверены. Бренд SAMO - вертикально интегрированная компания, которая контролирует качество на всех этапах производства. SAMO производит одежду из высококачественного хлопка, которая позволяет вашему телу дышать. Мы являемся крупнейшим экспортёром в текстильной продукции. На данный момент мы экспортируем наши продукты в 45 стран, такие как Германия, Испания, Италия, Польша, Португалия, Турция, Южная Корея, Япония и т.д. SAMO предлагает высококачественные услуги, поставляет ткани для вашего бренда а так же услуги по дизайну тканей, печати и окраске. За эти 27 лет компания SAMO уже заслужила хорошую  репутацию в обществе.',NULL,'+SAMOGROUP16','+998932751666','www.samo.uz','+998932751000','8','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/vx/h6/1t/c3b3d622-fbfb-4fd8-a5be-c3252d38c814.jpg',0.00,NULL,NULL,'2025-08-04 16:37:45','2025-08-04 16:37:45'),(1654,'Samokleyka.uz - Термо Стикеры Этикетки Баркод Самоклейка в Ташкенте','Samokleyka.uz',NULL,'info@samokleyka.uz',NULL,'1','Узбекистан',5.00,1,'1','2013','member','$2y$10$VMgcDGfNUPaLtY99aB8FyOqdOpH93eA//WC2u7mheq/f3RUzLV1oG','Samokleyka.uz\r\n\r\n-Термоэтикетки ЭКО\r\n-Термоэтикетки ТОП (термотоп)\r\n-Термо Этикетки для весов\r\n-Cамоклеящиеся этикетки\r\n-Термо Стикеры\r\n-Баркод для текстиль\r\n\r\nМолодая, амбициозная компания «Samokleyka.uz» была создана в 2013 году группой специалистов в области полиграфии.\r\n\r\nИспользуя накопленный опыт и знания было выбрано для инсталляции самое передовое оборудование ротационной высечки и флексографической печати ведущих мировых производителей. За короткий промежуток времени компании удалось занять прочные позиции на рынке чистой высечки и полноцветной печати. Наша компания располагает собственным производством по изготовлению этикеток и термотрансферных лент (риббонов). Наличие собственного оборудования позволяет контролировать качество производимых материалов на всех этапах производства, а также обеспечивает компании неограниченные возможности производства продукции.\r\n\r\nНа данный момент компания «Samokleyka.uz» производит более 500 размеров этикеток простых и сложных форм.\r\n',NULL,'@termostiker','+998998258545','https://samokleyka.uz/','+998998258545','1','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/lg/5n/2z/8e18e4b4-c5fe-4b32-8898-4518895bacc5.jpg',0.00,NULL,NULL,'2025-08-04 16:37:46','2025-08-04 16:37:46'),(1655,'Samo Sifat tekstil','Sst',NULL,'rmadaminov5454@mail.ru',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$pNCZYHMaxJEIFkbpQf5uIeVNdyvqN2nAumjZHS8nhCrjJnvpv/enq','Samo Sifat tekstil',NULL,NULL,'998911415454',NULL,NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/9h/1a/i3/2a7865b5-4688-4572-bd0c-688855760c3c.jpg',0.00,NULL,NULL,'2025-08-04 16:37:47','2025-08-04 16:37:47'),(1656,'SamoTekstilServis','SamoTekstilServis',NULL,'Terry-towel@ro.ru',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$YdfjlMzaytAR8384lVLEVeKZE1zCLZgRigyqG4Yoj2NGfE92rSNQC','sts',NULL,NULL,'+998972548284',NULL,NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/9w/zj/ew/fa4fd247-c8a7-41cc-9058-fb6585d33a77.jpg',0.00,NULL,NULL,'2025-08-04 16:37:47','2025-08-04 16:37:47'),(1657,'SamTextPlas LLC','SAMTEXSOCKS',NULL,'samtextplas1@mail.ru',NULL,'1','Узбекистан',0.00,1,'1','2020','member','$2y$10$3OhOYWO9AU/jtaXfi9aEeuwyCaUHbiNSh8eyLN1tQAjn4tpBE5pdm','Мы производим удобные носки мирового качества по новейшим итальянским (Lonati, Tecnopea, Autotex) и турецким (Tolon) технологиям.Наше качественное оборудование позволяет выполнять заказы клиентов в срок, качественно и по доступным ценам.',NULL,'+998889305510','+998889305510','sam