til sanoatida o‘zining mustahkam o‘rniga ega bo‘lgan, zamonaviy texnologiyalar va yuksak sifat tamoyillariga asoslangan yetakchi ishlab chiqaruvchilardan biridir. Yillik tajriba, innovatsion yondashuv va professionallik bizga o‘z sohamizda ishonchli brend sifatida shakllanish imkonini berdi.\n\nTo‘quv bo‘limi\nTo‘quv bo‘limimiz zamonaviy uskunalar bilan jihozlangan bo‘lib, tabiiy xomashyolardan sifatli matolar tayyorlanadi. Dizayn va mustahkamlikka alohida e’tibor qaratilib, mijozlarimiz talabiga mos turli xil to‘qimalar yaratiladi.\n\nBo‘yoqxona\nBo‘yoqxona bo‘limida ekologik toza va zamonaviy texnologiyalarga asoslangan bo‘yoq ishlari amalga oshiriladi. Matolarga rang berishda barqarorlik, yuvilishga chidamlilik va yorqinlik kabi muhim mezonlarga qat’iy rioya qilinadi.\n\nTikuv bo‘limi\nTikuv bo‘limimizda malakali mutaxassislar tomonidan turli xil kiyim-kechaklar, maxsus ish kiyimlari va tekstil buyumlari ishlab chiqariladi. Har bir mahsulotga individual yondashuv va yuqori sifat kafolatlanadi.\n\nBizning maqsadimiz\nMahsulotlarimiz orqali mijozlarimizga nafaqat qulaylik va ishonch, balki estetik zavq ham ulashish. Ichki va tashqi bozorda sifatli, zamonaviy va raqobatbardosh mahsulotlarimiz bilan ajralib turamiz.',NULL,'t.me/+998931662124','+998931 662 12 4',NULL,'+998931 662 12 4','$1.000.000-$5.000.000','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:38:19','2025-08-04 16:38:19'),(1784,'TIMTEX','производство трикотажного полотна',NULL,'timtexmax@gmail.com',NULL,'6','Россия',0.00,1,'1','2022','member','$2y$10$EO6yOPx.4A5qgZvVt1/E8u2fvZtksIqgrNoCcq96HGSRFESRmybu6','ТРИКОТАЖНЫЕ ПОЛОТНА\nКомпания «ТІMTEX» успешно существует на рынке СНГ более 10 лет. В 2022 нами была создана современная фабрика по производству готового трикотажного полотна и было принято решение об открытии представительства в Москве.\nМы рады предложить Вам нашу коллекцию тканей для одежды, которая отличается высоким качеством и разнообразием дизайнов. \nТАКИЕ ВИДЫ ТКАНЕЙ КАК КУЛИРКА