ULL,'a.kim@elcomspb.ru',NULL,'6','Узбекистан',0.00,0,'4','1998','member','$2y$10$dhLk.DwLdSk35pBqqhj1u.hO.jJqZWaj5okv2kFsADSpv.FT5Crra','Промышленное электротехническое оборудование',NULL,'+998903388998','+998903388998','elcomspb.ru','+998903388998','1','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:39:16','2025-08-04 16:39:16'),(1946,'Группа компаний Consul','',NULL,'hanvar76@yahoo.com',NULL,'7',NULL,0.00,0,'0','','member','$2y$10$FrYSEAyZ6M5RFfS88LtSMOyv.g7qGNefD9U4X.FzIzJehydk/xHre','О группе компаний CONSUL\r\nОснованная в 2010 году, Группа Компаний \"CONSUL\" – является ведущим интегратором в области автоматизации бизнеса в Узбекистане. Спектр решений компании позволяет покрыть практически все потребности бизнеса наших клиентов, которые сосредоточены в различных сферах.\r\n\r\nВ основе системной интеграции нашей компании лежат многолетняя экспертиза и оригинальные программные решения, разработанные нашими российскими партнерами, компанией «UCS» , Корпорацией «ДатаКрат» , «Кристалл Сервис», Группой компаний «ТехноКом», Компания «Технотон», Компания Macroscop , Компания «Логикон»   и др.\r\n\r\nНа сегодняшний день, Группа компаний Consul успешно внедряет решения по следующим направлениям:\r\n\r\n•	Автоматизации торговли и складского учета. \r\nСистема управления торговым предприятием S-MARKET. \r\nS-MARKET - это основа комплексной автоматизации для торговых предприятий различного профиля (оптовые склады, минимаркеты, универмаги, супермаркеты, бутики, discounter, Cash&Carry, оптово-розничные предприятия, торговые сети); \r\n•	Автоматизация склада и инвентаризация. \r\nСемейство программных продуктов для автоматизации складского учета, инвентаризации и систем лояльности клиентов DKLink (Mobile, Front Office, Inventory, CLM); \r\n•	Контроль и управления доступом, учет рабочего времени СКУД. \r\nСемейство программных продуктов торговой марки Барс: платежно – пропускные системы для спортивно – развлекательных объектов СкиБарс2, система контроля и управления доступом Барс-СКД, система регистрации и контроля доступа участников массовых мероприятий Барс-ЭКСПО; \r\n•	Автоматизация парковок и учета проезда и машиномест. \r\nСемейство программных продуктов торговой марки Барс.Паркинг:\r\n•	Автоматизация ресторанной деятельности R-Keeper. \r\nСамая популярная современная профессиональная система автоматизация ресторанов, кафе, баров и любых других объектов общественного питания. Система складского учета R-Keeper StoreHouse;  \r\n•	Автоматизация  деятельности гостиницы Shelter. \r\nСовременная профессиональная система управления гостиницей, санаторием, пансионатом или любым другим объектом размещения;\r\n•	Автоматизация деятельности кинотеатра Премьера. \r\nБилетная система для кинотеатров. Лидер среди систем автоматизации продажи билетов в кинотеатры, театры, музеи, парки отдыха;\r\n•	Система управления детскими игровыми автоматами GameKeeper . Автоматизация игровых центров.  Современная профессиональная система автоматизации семейных игровых развлекательных центров.\r\n•	 Автоматизация фитнес клубов, аквапаркров, бассейнов, система Абонемент. «Абонемент» – это универсальная система автоматизации аквапарков, SPA, фитнес клубов, бассейнов, катков, спортивно оздоровительных комплексов.\r\n•	Автоматизация медицинских учреждений ArchiMED.  \r\nПрофессиональная система автоматизации медицинских учреждений любого профиля.\r\n•	Система спутникового мониторинга транспортных средств ГЛОНАСС/GPS, система АвтоГРАФ.  \r\nСистема спутникового мониторинга и контроля транспорта «АвтоГРАФ» – это аппаратно-программный комплекс, разработанный специалистами ООО \"ТехноКом\" на основе самых современных технологий в области спутниковой навигации, а также каналов передачи и обработки данных.\r\n•	Система спутникового мониторинга транспортных средств ГЛОНАСС/GPS, система АвтоГРАФ.  \r\nСистема спутникового мониторинга и контроля транспорта «АвтоГРАФ» – это аппаратно-программный комплекс, разработанный специалистами ООО \"ТехноКом\" на основе самых современных технологий в области спутниковой навигации, а также каналов передачи и обработки данных.\r\n•	Профессиональное решение для IP камер Macroscop\r\nЭксклюзивная технология видеоанализа сжатых видеопотоков от видеокамер без полного декодирования, которая увеличивает скорость обработки данных в 4 раза. Это позволяет сократить расходы на вычислительное оборудование или установить больше камер на сервер.\r\n\r\nПомимо указных систем, группа компаний CONSUL также занимаемся поставками систем маркировки и выпуском пластиковых карт (принтерами для печати этикеток и карт, расходными материалами к ним). Налажено производство сенсорных информационных киосков.\r\n\r\nГруппа компаний CONSUL - многофункциональная компания, активно развивающая сразу несколько направлений деятельности, что дает неоспоримое преимущество перед конкурентами в реализации задач для своих Заказчиков, как по любому из этих направлений, так и в комплексе, предлагая индивидуальные интегрированные решения «под ключ», включая  проектирование, поставку оборудования, монтаж, пуско-наладку, авторский надзор и дальнейшее сервисного обслуживания.\r\n',NULL,NULL,'+998915482360','www.consul.uz',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/hs/tm/v6/0ee4894d-c11f-4a50-946f-2c3b77aab6b9.jpg',0.00,NULL,NULL,'2025-08-04 16:39:16','2025-08-04 16:39:16'),(1947,'Группа Компаний МАЙЛС','',NULL,'skibina_yv@miles-logistic.com',NULL,'0','Россия',0.00,0,'0','','member','$2y$10$00SID3u41vEscbv5hO4ZwOBnGeN2gdAiONwwgE3t3tFfI/rUwBSNK','',NULL,NULL,'+78004443236','http://miles-logistic.com','+79854114232','0','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:39:16','2025-08-04 16:39:16'),(1948,'ДАКА-ИНТЕХ','ДАКА',NULL,'isakovolimzon3@gmail.com',NULL,'1','Узбекистан',0.00,1,'3','2017','member','$2y$10$z0rRHFkUAgxHMjToBOJt9.osTAGhp54gtdiKSByAgN16nEb0Gwxiq','Текстильное производство',NULL,'+974497240','+998974497240',NULL,'+998974497240','1','company','/avatars/default.pn