$10$cQJGDXMtIP1dEi3AwXIJAuBc0Bhkr4vJdtE6OE07SUmQzIKBw26p6','Иностранное предприятие «LUKA TEXTILE» основано в 2010 году. За время существования компания зарекомендовала себя как надежный производитель и поставщик качественной текстильной продукции.\r\n\r\nБольшой опыт и постоянное изучение рынка сделали свое дело — мы стали крупной, устойчивой компанией, с большим количеством постоянных клиентов на территории России. Производя 1 000 000-1 500 000 штук изделий в месяц.\r\n\r\nСреди наших клиентов:\r\nKIRPI BABY, KIRA PLASTININA, GLORIA JEANS, ZARA, MODIS, ASHAN, METRO, Bershka, ZEEMAN, C&A, PRIMARK, NEWLOOK, TOPMAN, WISSMACH, NewYorkeR, Vögele, Western Stores, Euroopt.\r\n\r\nСотрудники Иностранного предприятия «LUKA TEXTILE»— профессиональные и ответственные люди, которые постоянно совершенствуют свои знания и навыки, проходят курсы повышения квалификации и активно осваивают новые технологии текстильной промышленности. Четко налаженные процессы производства позволяют выпускать продукцию в срок, а серьезный контроль гарантирует высокое качество производимых текстильных изделий.\r\n\r\nВ разработке моделей одежды используются оригинальные авторские идеи наших дизайнеров и опыт технологов.\r\n\r\nИмеем высококачественные вышивальные станки в количестве 12 шт, производительность которых 400 000 изделий в месяц.\r\n\r\nЗалогом успеха компании является использование исключительно японского оборудования, качественного сырья и контроль качества на всех этапах производства. Все это в сочетании позволяет нам производить комфортные, стильные, удобные и практичные в использовании модели. Наш трикотаж рассчитан для широкого круга потребителей, а постоянное обновление коллекций и хорошо налаженная работа маркетингового отдела, дает нам возможность плодотворно сотрудничать с партнерами в долгосрочной перспективе.\r\n\r\nТакже производит любой трикотаж на заказ: стильные мужские, женские, детские, ясельные изделия, платья трикотаж, юбки, блузы, водолазки, спортивные костюмы, футболки, рубашки, брюки, шорты, платья, носки, нижнее и постельное белье, майки и др. Материал, из которого изготавливается одежда - трикотаж. Трикотаж отличается удобством, качеством, долговечностью. Используются высокопроизводимые станки по изготовлению печати на трикотажной продукции в количестве 1 200 000 шт. в месяц.',NULL,NULL,'+998707140527, +998707140554, +998707140580','luka.uz',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/tq/0s/w6/ac711c34-9e94-4e80-8fe8-443eea85e5aa.jpg',0.00,NULL,NULL,'2025-08-04 16:39:23','2025-08-04 16:39:23'),(1978,'ИП ООО \"LUKBO TEKSTIL\"','Kirpibaby',NULL,'svetlanazborec@lukbotextile.uz',NULL,'1','Узбекистан',0.00,1,'3','2010','member','$2y$10$Ln5FFh44/4q3GMOUcdH6cud63CxfyksKhpHoA6IGca.lrpZ9xWw16','Иностранное предприятие «LUKBO TEXTILE» было основанно в 2010г. «LUKBO TEXTILE» - современное динамичное предприятие, которое специализируется на выпуске текстильной продукции: хлопчатобумажной ткани и пряжи, используя в качестве сырья лучшие сорта хлопка, выращиваемого в Узбекистане.\nПродукция соответствуют международным стандартам качест- ва, и производится из 100% хлопка.\n«LUKBO TEXTILE» расположено в городе Чирчике, Узбекистан. За Время существования компания зарекомендовала себя как надежный производитель и поставщик качественной продукции. Залогом успеха компании является использование исключительно японского оборудования, качественного сырья и контроль качества на всех этапах производства. Все это в сочетании позволяет нам производить комфортные, стильные, удобные и практичные в использовании модели.',NULL,'+998 91 775 85 05','+998917758505','lukbotextile.uz','+998917758505','5','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/l3/ww/v0/4c3b3573-299e-420f-92ed-6f8f2a99da06.jpg',0.00,NULL,NULL,'2025-08-04 16:39:23','2025-08-04 16:39:23'),(1979,'ИП ООО Medex Textile','MEDEX ',NULL,'zulunov_d@mail.ru',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$RqD4DD4XL4r9Fjxnwl6lL.7REs4Wo0W3zeJ0ymuJRKq1tkRSqroPC','Производитель пневмопрядильных нитей. Производит смесовую пряжу.',NULL,NULL,'+998911700005',NULL,NULL,'','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:39:24','2025-08-04 16:39:24'),(1980,'ИП ООО \"NATURE COTTON\"','NATURE COTTON',NULL,'naturecotton100@gmail.com',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$XD8tvAuEGmzyh6YMzKrpMuKZiE2UGuuQs2DoPHNvHSk7.TMKycX6K',' ИП ООО «NATURE COTTON» является одним из ведущих предприятий по производству трикотажных изделий из хлопчатобумажной пряжи Узбекского хлопка высокого качества.\r\nОсновная стратегия нашего развития — предоставление качественных услуг. В них входит весь комплекс услуг по пошиву и созданию одежды: разработка лекал, производство полотна, подборка необходимых декоративных элементов, нашивки с логотипами на готовые изделия, или другими дизайнами, принтов всех видов нанесения. Мы поддерживаем со многими иностранными предприятиями, изготавливающие качественные и уникальные аксессуары для одежды по задумке заказчиков.\r\nНакопленный опыт позволяет качественно отшивать любой ассортимент любой возрастной группы. Для этого привлечены необходимые иностранные специалисты и поэтому мы можем сшить всё: от сложных дизайнерских платьев до многотысячных тендерных заказов. И наша работа заканчивается отправкой готовых изделий в страну назначения.',NULL,NULL,'99871 2533659','naturecotton.uz',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/v0/r9/l9/48bff8c3-cb0f-4f76-b07a-9566b5f0412e.jpg',0.00,NULL,NULL,'2025-08-04 16:39:24','2025-08-04 16:39:24'),(1981,'ИП ООО \"OsbornTextile\"','Mirelle',NULL,'info@osborntextile.uz',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$FIaNGA1mG6zG7KfCBU.JwO4.nBHIxHyo9MkhoJTNx3uQ76JndyJ.K','ИП ООО «Osborn Textile» имеет технические и производственные мощности для удовлетворения спроса заказчиков по поставке:\r\n- кольцепрядильной и компактной крашенной пряжи из 100% хлопка;\r\n- меланжевой пряжи из 100 % хлопка  и смесовой меланжевой пряжи из хлопка/полиэстера;                                                                                 хлопка/модал); \r\nДиапазон номеров пряжи от Ne 12 (Nm 20) до Ne 40 (Nm 68) с определенной круткой и с заданным    количеством сложений.\r\n- крашенной бамбуковой и модальной пряжи диапазоном номеров пряжи от Ne 16/1 (Nm 27/1) до Ne 50/1 (Nm 85/1); \r\n- смесовой суровой и крашенной пряжи (полиэстер/хлопок) \r\nКроме этого, предприятием производятся и предлагаются на реализацию трикотажные полотна и махровые ткани, а также  готовые махровые и велюровые изделия, выпускаемые под маркой «Mirelle» из 100% хлопка и смесовые (40% хлопок/ 60% бамбук; 30% хлопок/ 70% бамбук): халаты, парео, килты, покрывала для спальни,  коврики для ванной, полотенца махровые и велюровые, махровые и велюровые изделия.\r\nПредприятие оснащено новейшим текстильным оборудованием известных мировых производителей: Trutzschler, Rieter, Zinser, Grossenhainer, Savio, Murata, Volkmann, SSM, Sulzer, Vamatex, Dilmenler.\r\nПроизводимая продукция сертифицированная, обладает высокими гигиеническими свойствами. ',NULL,NULL,'+998935016306; +99871 150 56 82; +99871 150 56 83; +99871 150 56 85; ','www.osborntextile.uz; www.mirelle.uz',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/vq/kc/cd/1ebdcc20-a108-410b-b608-205841275526.jpg',0.00,NULL,NULL,'2025-08-04 16:39:25','2025-08-04 16:39:25'),(1982,'ИП ООО \"PAPFEN\"','PAPFEN',NULL,'papfen.gmb@gmail.com',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$CO7hFkTrK/bTM6Mp6c6Ixe6p8XLanUKPfsL2GTFRegvSQwMB0XnYG','ИП ООО «PAPFEN» немецкая компания по производству 100% х/б пряжи имеет технические и производственные мощности для удовлетворения спроса заказчиков по поставке:\r\n- кольцепрядильной пряжи из 100% хлопка;\r\n',NULL,NULL,'+998907400018',NULL,NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/lq/sf/10/1f10c591-b7ae-4124-9c33-627a0ac19281.jpg',0.00,NULL,NULL,'2025-08-04 16:39:25','2025-08-0