 процессов приводит к снижению затрат на труд и ресурсы, что, в свою очередь, увеличивает прибыльность бизнеса.\n\nКонтроль качества: Инструменты для мониторинга и анализа качества производимой продукции позволяют выявлять дефекты на ранних стадиях, что значительно снижает количество бракованных товаров.\n\nУправление запасами: Система следит за остатками материалов и готовой продукции, обеспечивая их наличие в нужное время и в нужном количестве. Это позволяет избежать как переизбытка, так и нехватки ресурсов.\n\nОтчеты и аналитика: Apoint предоставляет инструменты для создания детализированных отчетов по производственным процессам, что позволяет более точно планировать будущее и принимать обоснованные решения.\n\nСкладской учет: Уникальные возможности управления вашим складом.\n\nHR-модуль: Контроль посещаемости и управление рабочим графиком сотрудников.\n\nKPI: Определение эффективности работы вашего предприятия.\n\nАвтоматизация финансов: Автоматизированный учет и контроль финансовых потоков, что позволяет эффективно управлять бюджетом и минимизировать финансовые риски.\n\nАвтоматизация продажи и POS: Решения для автоматизации процесса продаж и удобного управления точками продаж, что улучшает обслуживание клиентов и ускоряет процесс обработки заказов.\n\nС помощью Apoint компании могут достичь значительных результатов:\nСокращение времени обслуживания клиентов в 3 раза.\nСнижение товарных излишков на складе на 24%.\n100% мониторинг производственных процессов.\nУменьшение расчетов заработной платы сотрудников до 99%.\nПреимущества Apoint:\nПолный контроль и учет сырья в производстве.\nМобильные складские решения без ограничений.\nВнедрение систем лояльности и скидок.\nРасширенный модуль бухгалтерии и автоматизация продаж.\nКлиенты компании отмечают значительное улучшение в управлении задачами и зарплатами сотрудников, что позволило оптимизировать бизнес-процессы и увеличить прибыль. В числе клиентов Apoint такие компании, как Aziza Cake, Triomax, Oltin Mato и многие другие.\n\nЕсли вам нужна подробная информация, прокрутите вниз на нашем сайте или свяжитесь с нами!',NULL,'apoint_uz','+998781132001','https://apoint.uz','+998977272002','2','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/ll/35/4a/b05da42c-b595-49c7-8bc8-92c6106c7f5f.png',0.00,NULL,NULL,'2025-08-04 16:39:36','2025-08-04 16:39:36'),(2027,'ООО \"Asma Textile\"','asma',NULL,'planet-o@mail.ru',NULL,'1','Узбекистан',0.00,1,'1','2022','member','$2y$10$eRcbId6lZx12Cn3D3MBV7ud/f1aoEperpsqf35bD5mpz4KjVCJBh6','Все виды трикотажных изделий',NULL,'t.me/+planet_ooo','+998993 285 44 2',NULL,NULL,'','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:39:36','2025-08-04 16:39:36'),(2028,'ООО \"Asr Imkon Textile\"','',NULL,'jDhWMvlZ32@example.com',NULL,'1','Узбекистан',0.00,1,'3','2017','member','$2y$10$1k/aC/i7XcgQApQETg7QSe.ja5bxKIvshy7xQBDGIQSw0SmvumoQ.','Производство трикотажных изделий',NULL,NULL,NULL,NULL,NULL,'4','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:39:37','2025-08-04 16:39:37'),(2029,'ООО AZALIUM','',NULL,'a.xachatryan@azalium.uz',NULL,'1','Узбекистан',0.00,1,'3','2003','member','$2y$10$aOF8xEqUF2utqXHwUadV.Ok1T/GZAlqog4ErNjZFZyK1rvrIBjZRC','AZALIUM – швейное предприятие, специализирующееся на производстве готовой одежды из кроенного трикотажа и ткацких полотен. Основная продукция компании это - трикотажная одежда для детей и взрослых любой сложности от нижнего белья до верхнего слоя. Основной ассортимент выпускаемой продукции: футболки, майки, худи, свитшоты, брюки, спортивная одежда, платья, одежда для дома и сна. \nКомпания основана в 2003 году и сегодня предприятие состоит из двух филиалов находящихся в г. Ташкенте с коллективом сотрудников более 250 человек. \nПроизводство состоит из следующих циклов: \n- разработки конструкций моделей и технологии пошива \n- размещение заказа на сырье и фурнитуру, контроль качества сырья \n- раскроя полона, пошива, ВТО, контроля качества и упаковки\n\nОсновным направлением нашей деятельности является: аутсорсинг услуг в производстве готовой трикотажной одежды «под ключ». Мы принимаем заказы от наших клиентов по их техническому заданию, также можем предложить свои разработки по дизайну и лекалам. \nКомпания занимается экспортом продукции с 2012 года, география экспорта охватывает Россию, Казахстан, Украину и Литву. Более 80% продукции реализуется в РФ. Мы сторонники долгосрочных взаимовыгодных отношений с нашими заказчиками. Одни из наших постоянных клиентов являются такие торговые марки как OMSA, MIA CARA, COZY HOME, JUNO, UMKA.\nВ 2021 году мы запустили собственный брэнд женской одежды OMIO DIO. Коллекции данного бренда состоят из платьев, топов, юбок и брюк из высококачественных ткацких полотен, произведенных в Турции. Наряду с импортными тканями мы используем натуральный хлопковый трикотаж из Узбекистана для домашней и спортивной одежды. Наши собственные разработки дизайна и конструкции позволяют достичь удобной посадки изделий, соответствуют модным современным трендам, а качество пошива отвечает уровню мировых брендов сегмента middle up и выше.\nДля достижения высокого уровня качества на нашем предприятии используется швейное оборудование таких передовых марок как YAMATO, JUKI, KANSAY, BROTHER.\nНашими поставщиками хлопкового трикотажного полотна являются лидеры текстильной промышленности Узбекистана. Также мы можем предложить смесовые трикотажные и ткацкие полотна производства Турции и Китая из искусственных, синтетических и натуральных волокон для создания женских и мужских коллекций.',NULL,'+998 90 176 38 76','+998901763876','azalium.uz','+998901763876','4','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/91/q0/e6/96ce1179-7fb1-4c50-a1fe-3ee2a117eb60.jpg',0.00,NULL,NULL,'2025-08-04 16:39:37','2025-08-04 16:39:37'),(2030,'ООО \"Belteks Tashkent\"','',NULL,'Doniyor_n@mail.ru',NULL,'7',NULL,0.00,0,'0','','member','$2y$10$wfjhBPr.liEeOQWYYzhZ1.FkZbIs0/0Gd/1NGXg8U44iUSMfzgeYS','Производство трикотажного полотна',N