ack была основана в 2003 году и с 2010 года является лидером по продаже промышленных швейных машин среди заводов Китая. В Jack работает более 3000 сотрудников, включая 1000 инженеров и технических специалистов. Кроме того, Jack постоянно занимается обучением и повышением квалификации своих сотрудников. На протяжении многих лет Jack продвигает различные новшества, чтобы обеспечить своих партнеров и клиентов конкурентоспособным оборудованием, благодаря чему Jack остается брендом №1 на глобальном уровне.\n',NULL,'+998909968090','+998 90 996 80 90','http://jack.uz','+998 90 996 80 90','1','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/f2/v9/79/f2e71d44-9ef9-4ee6-8fdc-2c32ae6f6a97.jpeg',0.00,NULL,NULL,'2025-08-04 16:39:43','2025-08-04 16:39:43'),(2057,'ООО\"KAMOL BIRLIK TEKSTIL\"','BIRLIK',NULL,'kamolbirliktekstil@mail.ru',NULL,'2','Узбекистан',0.00,1,'2','2010','member','$2y$10$9dPi8hBxaWhaYU7N4nb7a.RkWVciUYlSjOTqYjn5Znxi5wOf.XuzK','',NULL,'@Kamol774','+998983107774',NULL,'+998971307774','','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:39:44','2025-08-04 16:39:44'),(2058,'ООО «Kariba-Tex”','Kariba Tex',NULL,'baychibaevakarina@gmail.com',NULL,'1','Узбекистан',0.00,1,'1','2023','member','$2y$10$aSxxT406cBY1KmI6mtSvmeTQ7TxYmYfUr3TDUcl5tL2pRszi.KsVS','Производство домашнего текстиля',NULL,'t.me/++998975710340','+998975710340',NULL,'+998975710340','','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:39:44','2025-08-04 16:39:44'),(2059,'ООО \"LIZI KIM TEXTILE\"','elephantino',NULL,'elephantino.tex@gmail.com',NULL,'1','Узбекистан',0.00,1,'2','2010','member','$2y$10$KuKW4bs.ba/ew.o8AfgI4.Vm1kWd7ON/59CifDUnor0OLJwvv58RS','OOO «Lizi Kim Textile» находящееся в республике Узбекистан, город Ташкент\nДата основания: 2010 год\nПроизводственная мощность 450 000 единиц изделий в месяц\n\nОсновной вид деятельности: Детская одежда, бренд «Elephantino» а также Private label — производство продукции под брендами заказчиков.\n\nВиды продукции: Одежда для ясельной группы, нижнее детское белье, пижамы, футболки, поло, рубашки, шорты, толстовки, худи, школьная одежда, джинсовая одежда.\n\nСостав продукции: 100% хлопок, а также продукция с добавлением эластана, процентное соотношение: 95% хлопок, 5% эластан.\n\nПроизводство продукции включает в себя 7 циклов:\n\nИзготовление ткани: Вязание полотна, в соответствии с заявленными требованиями заказчика. Характеристики полотна: Тип ткани, плотность, состав.\n\nКрашение полотна: а) однотонное, б) нанесение принтов (паттернов) Тип нанесения: ротационная печать, цифровая, шелкотрафаретная и DTF-печать. После утверждения дизайна, образцы тканей направляются заказчику на подтверждение.\nЭлементы декора на изделии: Вышивка, принты, аппликация в соответствии с техническими требованиями заказчика.\nЛекала изделия: доступен широкий ассортимент готовых лекал, заявленных изделий. Также есть опция изготовления лекал, по требованиям заказчика в соответствии с ГОСТами.\n\nУтверждение опытного образца: утверждается состав, плотность, крашение полотна, элементов декора на изделии, пошив опытного образца в трех экземплярах (один направляется заказчику, второй остается у подрядчика, третий передается в производственный цех как эталон).\n\nПроизводственный процесс:\nа) Раскрой полотна: Проверка на наличие фабричного брака полотна. Автоматизированная раскладка лекал и крой деталей. Данная технология экономит время, и дает максимальную эффективность.\nб) Пошив: Процесс потоковый, на каждом потоке трудятся 30 квалифицированных сотрудников. На производстве имеется три потока, что позволяет выдавать в среднем до 15 000 готовых изделий за рабочую смену.\nв) Чистка, глажка изделия перед упаковкой.\nг) Упаковка изделия\nд) Маркировка в соответствии с техническим заданием заказчика: Fulfilment, маркировка изделия на навесной карте, на пакете, на коробах.\n\nКонтроль качества происходит в три этапа:\nа) первичный контроль: осуществляется в процессе пошива на соответствие лекал по заданному таблемеру,\nб) вторичный контроль: швов, строчек, наличие брендированных бирок, а также уходника в соответствии со стандартами заказчика,\nв) третий этап контроля: визуальный осмотр готового изделия перед упаковкой.\n\nБрендирование в соответствии с техническим заданием заказчика: Изготовление бирок и упаковки, нанесение логотипа и технических параметров. Типы бирок: жаккардовые, сатиновые, хлопковые ленточные и патчи, картонные. Типы упаковки: пакеты, зип-пакеты, картонные короба.\n\nВсе используемые ткани и изделия сертифицированы.\n\nВ сотрудничестве с селлерами на Wildberries\nBaby Hug\nСнегири\nThe body\nRamelka\nMamanna\nMamas&Papas\nDialooke.\n\n',NULL,'ele_manager','+998772722750',NULL,NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/o1/e5/gm/e045c5ea-8d31-4ba9-bd77-c38ce793d05b.png',0.00,NULL,NULL,'2025-08-04 16:39:44','2025-08-04 16:39:44'),(2060,'ООО \"MADINA MUAZZAM\"','MADINA MUAZZAM',NULL,'inomjon.79@mail.ru',NULL,'1','Узбекистан',0.00,1,'2','2008','member','$2y$10$S5bk6u84sjNdhlrCPsTYHO/zpWHxStZEmSZ0Tzus6lMHLQFnOvaA.','Нетканное полотно, вафельная ткань',NULL,'t.me/+912811018','+998 91 281 10 18',NULL,'+998 91 281 10 18','$1.000.000-$5.000.000','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:39:45','2025-08-04 16:39:45'),(2061,'ООО «Majortex»','Majortex',NULL,'info@majortex.uz',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$SYaC0syqac0MSmJaCG1zTu6W0qNa.Mne.sXP2LFVWlZTQC2JztWN6','Компания Majortex выполняет заказы на производство текстильной продукции любой сложности и объёма.\r\n\r\nОсновные направления деятельности:\r\n- Производство спецодежды\r\n- Производство корпоративной одежды\r\n- Производство трикотажных изделий\r\n- Производство постельного белья\r\n- Производство махровых изделий\r\n- Услуги салона-ателье',NULL,NULL,'+998 (90) 952-59-95','https://majortex.uz',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/x1/rw/dx/38896a6f-d5e9-47c4-b77e-b9a7fc0767a4.png',0.00,NU