спортном и импортном сообщениях.\r\nОсновными направлениями деятельности нашей компании являются:\r\nАвто перевозки\r\nНаличие своего авто парка (при партнёрстве с ООО Ravshan) позволяет нам осуществить\r\nбыстрые и недорогие автомобильные грузоперевозки между странами Европы, СНГ и\r\nСредней Азии.\r\nПредлагаем перевозки генеральных (FTL), сборных (LTL), опасных (ADR) грузов, а также\r\nперевозки грузов с температурным режимом. Для транспортировки Ваших грузов, мы\r\nорганизуем все необходимые подготовительные работы, а также погрузку и выгрузку грузов,\r\nкрепление и проверку надежности упаковки. При необходимости, также обеспечим перегруз и\r\nконсолидацию грузов на складах.\r\nАвиа перевозки\r\nЭффективные решения для перевозки срочных грузов. Тесное сотрудничество с\r\nавиакомпаниями и аэропортами по всем мире, позволяет нам находить уникальные решения\r\nпри перевозке сложных и негабаритных грузов посредством авиа транспорта.\r\nЖелезнодорожные грузоперевозки.\r\nМы предлагаем все виды железнодорожных перевозок по территории Европы, стран СНГ, а\r\nтакже из Китая и других стран Азии. Компания ООО «NULLMAX» обеспечивает высокое\r\nкачество обслуживания за счет оптимизации расходов на перевозку Вашего груза, учитывая\r\nспецифику, количество и условия поставки.\r\nМорские грузоперевозки\r\nОсуществляем доставку Вашего груза морскими путями в любую точку мира. Мы\r\nобеспечиваем доставку DOOR to DOOR для полных (FCL) и сборных (LCL) контейнерных\r\nгрузов.\r\nМультимодальные грузоперевозки\r\nМультимодальные грузоперевозки осуществляются с помощью комбинации различных видов\r\nтранспортных средств: автомобильных, железнодорожных, морских, авиационных. Данного\r\nвида грузоперевозки незаменимы, при необходимости осуществлять международные\r\nперевозки на дальние расстояния, и позволяют разработать наиболее удобную и экономичную\r\nсхему доставки груза в любую точку мира. Налаженная схема работы с региональными и\r\nзарубежными перевозчиками, база транзитных портов по всему миру позволяет гарантировать\r\nбезопасность Вашего груза и минимальные сроки доставки, мы разработаем индивидуальную\r\nлогистическую схему для Вашей перевозки.\r\nТакже предлагаем услуги по комплектации и маркировке заказов; услуги по страхованию и\r\nтаможенному оформлению груза, складские услуги - хранение, упаковка груза и прочее;\r\nоформление всех перевозочных документов и т.д.',NULL,'@logistics_null','+998992074640','https://nullmax.uz/ru',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/7a/xz/dj/0d26cf05-0a58-4d4e-96c7-7afef5c78f9a.jpg',0.00,NULL,NULL,'2025-08-04 16:39:49','2025-08-04 16:39:49'),(2076,'ООО OXIANA TRADE LOGISTICS','OTLUZ',NULL,'transoxiana1@gmail.com',NULL,'4','Узбекистан',0.00,0,'1','2016','member','$2y$10$AJ2.EiLf9tkO2DY9Tp7q1.VwDualu3zHV.i.TNNaTu/i2t/xu40vW','Междугородние и международные грузоперевозки',NULL,'+998977057063','+998977057063','https://otluz.business.site','+998977057063','','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/4p/0v/uo/3b272319-8cea-4432-8f12-1eae1e24ed22.jpg',0.00,NULL,NULL,'2025-08-04 16:39:49','2025-08-04 16:39:49'),(2077,'ООО Panorama Vision','',NULL,'info@posm.uz',NULL,'7',NULL,0.00,0,'0','','member','$2y$10$dj/8wOCsECZ9Qt6jcY8XTOMYzNXmVFzW3ip9wNwMR1mBPSyeQGOra','Производство',NULL,NULL,'128-53-93','www.posm.uz',NULL,'','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:39:50','2025-08-04 16:39:50'),(2078,'ООО \"PLATINUM TEKSTIL\"','',NULL,'lara22@mail.ru',NULL,'2','Узбекистан',0.00,1,'3','2010','member','$2y$10$rw2Hg8peO96/LBXzWL20ueoZQOtS4Wu8f0gwYopnavVUiKukwMJlq','Продажа оптом продукции из трикотажа в больших объемах под ваш заказ. ',NULL,'@daniel','+79774346372','platinumtekstil.uz','+79774346372','','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:39:50','2025-08-04 16:39:50'),(2079,'ООО «PLOMBA COM UZ»','PLOMBA COM UZ',NULL,'info@plomba.com.uz',NULL,'3','Узбекистан',0.00,0,'5','2019','member','$2y$10$Rkr6/3