ULL,0.00,0,'0','','member','$2y$10$pcvn3T0eXtMOXtp3Cpvat.llK.YoNWZyMDDNU9ixvnjjE9Mkuo9Lm','Трикотажные изделия',NULL,'@shakhachiloff','+998955051122',NULL,NULL,'','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:40:12','2025-08-04 16:40:12'),(2158,'ООО \"Урюпинская трикотажная мануфактура\"','УТМ',NULL,'olgasawenkowa1988@gmail.com',NULL,'1',NULL,0.00,0,'2','','member','$2y$10$8KQpfiiDkGChXZmWjcoXcOiekoeY8zZ0zd8.vMr7bozCehuWlslkW','Урюпинская трикотажная фабрика, основанная в 1968 году, продолжает успешно функционировать и активно развиваться, сохраняя традиции качества и внедряя современные тенденции в производстве. Предприятие выпускает широкий ассортимент трикотажных изделий, известных и любимых потребителями, а также регулярно обновляет коллекции, предлагая новые и современные модели, соответствующие актуальным модным направлениям.\nВ 2018 году фабрика отметила своё 50-летие, подтвердив статус одного из ведущих предприятий лёгкой промышленности региона. Несмотря на экономические вызовы, фабрика сумела адаптироваться к новым условиям, сохранив рабочие места и продолжая радовать клиентов качественной продукцией.\nСегодня фабрика предлагает разнообразный ассортимент трикотажных изделий для всей семьи, уделяя особое внимание качеству материалов и современному дизайну. Благодаря использованию передовых технологий и постоянному обновлению оборудования, предприятие обеспечивает высокие стандарты производства и удовлетворяет потребности самых требовательных клиентов. \nПостоянный мониторинг модных тенденций позволяют фабрике создавать актуальные и стильные модели, которые находят отклик у широкой аудитории. Урюпинская трикотажная фабрика гордится своей историей и с уверенностью смотрит в будущее, продолжая развиваться и радовать потребителей качественной и современной продукцией.\n\"Урюпинская трикотажная мануфактура\" — это современное предприятие с богатой историей и сильными традициями. Мы специализируемся на производстве качественной трикотажной одежды для мужчин и женщин, уделяя внимание каждой детали.\nПолный цикл производства\nВсе этапы изготовления продукции — от разработки дизайна до пошива готовых изделий — проходят на нашей фабрике. Это позволяет нам полностью контролировать качество и оперативно реагировать на потребности клиентов.\nСобственные мощности\nПроизводство оснащено современным оборудованием, что позволяет работать с такими материалами, как:\nФутер (теплый и мягкий для комфортной носки).\nФутер с лайкрой (эластичный и долговечный).\nКулирка (лёгкая, идеальная для летней одежды).\nи другие трикотажные полотна.\nВысококвалифицированная команда\nНаши швеи, конструкторы и технологи — это профессионалы своего дела с многолетним опытом. Каждый сотрудник вкладывает душу в создание качественной и стильной продукции.\nГибкость в ассортименте\nМы предлагаем широкий выбор одежды:\nМужские и женские спортивные костюмы, домашняя одежда..\nСорочки и халаты.\nМайки, футболки, трусы и другие базовые изделия.\nЭкологичность и надёжность\nМы работаем только с проверенными поставщиками тканей и заботимся о том, чтобы наша продукция была безопасной и долговечной.',NULL,NULL,'+79616892279','https://utrim34.ru/','+79616892279','undefined','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:40:12','2025-08-04 16:40:12'),(2159,'ООО ФОРЕСТКОЛОР','Forestcolor',NULL,'shomatov@yandex.com',NULL,'1','Узбекистан',0.00,1,'3','2011','member','$2y$10$JvEyVfiTXODdAi47icB6SO8E7PtF2weqaEOXq/T9.IHgE50ukn6vy','жаккардовое трикотажное полотно, швейная фабрика.',NULL,'+998905503344','+998905503344','www.forestcolor.uz','+998905503344','4','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/1e/wx/kn/b34b0701-b87e-4f0f-bb72-ba7804ec8f2b.jpg',0.00,NULL,NULL,'2025-08-04 16:40:13','2025-08-04 16:40:13'),(2160,'ООО Фурнитур-ВУ','Фурнитур-ВУ',NULL,'sale@furnitur.by',NULL,'2','Белоруссия',0.00,1,'3','2010','member','$2y$10$FUDZ57Ypw8LItBW4PPmA0.25SV3h.UwZ/dNr7q5R20SC.XNH/jDX2','   ООО «Фурнитур-ВУ» - это крупнейшее в СНГ предприятие, которое специализируется на производстве и поставках фурнитуры для обувной, швейной и галантерейной промышленности из металла и пластика, а также комплектующих для производства обуви.\r\n   Растущие объемы выпуска, безупречное исполнение всех взятых на себя обязательств сделали нашу компанию надежным партнером для флагманов легкой промышленности стран СНГ. С 2017 года мы вышли на новые рынки сбыта в Европе, Азии и Латинской Америке. ООО «Фурнитур-ВУ» всегда там, где требуется высокое качество, оптимальная цена и гарантия своевременности поставок.\r\n    В производственных цехах нашего завода установлено оборудование мирового уровня (OMPSA, MOSSINI, IMEL, DM и др.), а технический персонал ежегодно повышает свою квалификацию, проходя обучение в Германии и Италии. Мы любим то, что делаем, ведь в процессе создания фурнитуры не бывает мелочей! Кропотливая работа сотрудников компании позволяет внедрять передовые технологии и выпускать продукцию высочайшего качества, контролируя производственный процесс на всех этапах, от разработки технической документации до серийного выпуска продукции и упаковки. В нашей компании трудятся более 100 высококвалифицированных специалистов.Производство, маркетинг, сбыт, логистика, сертификация - это лишь малая доля того, в чем мы по-настоящему разбираемся, гарантируя надежность и спокойствие своим клиентам.\r\n    Длительные партнерские взаимоотношения с лучшими производителями из 11 стран мира позволили сделать ассортимент обувной фурнитуры, аксессуаров и комплектующих самым широким на белорусском рынке. Ценовая политика ООО «Фурнитур-ВУ» рассчитана на различные категории потребителей и проработана для оптимального соотношения цены и качества продукции.\r\n    За 15 лет компания прошла большой путь становления и развития, заслужив доверие свыше 1500 клиентов. Обувные фабрики, швейные предприятия и галантерейные производства Республики Беларусь и за ее пределами, оценили преимущества работы с ООО \"Фурнитур-ВУ\" : прозрачны