тельным ценам. Для постоянных покупателей предусмотрены дисконты и выгодные условия. А так же мы рады предложить клиентам трикотаж оптом на заказ.\r\n\r\nНаш девиз*\r\n\r\nКупи с первого взгляда!',NULL,NULL,'+998933070250',NULL,NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/m5/bv/sr/5cf8cb2a-0e65-4ef3-874b-bb8b389a745d.jpg',0.00,NULL,NULL,'2025-08-04 16:40:22','2025-08-04 16:40:22'),(2197,'СП \"POLIGRAF GROUP\"','POLIPACK',NULL,'polipack@list.ru',NULL,'7',NULL,0.00,0,'0','','member','$2y$10$XEtYCNH5DUXJdIp7UbKYR.itwvcJThlgpoMamI0M.MRvekjEBtC7a','Производство полиграфических продукций',NULL,NULL,'+998909070010','polipack.uz',NULL,'','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:40:22','2025-08-04 16:40:22'),(2198,'СП \"АминИнвестИнтернейшнл\"','Stuff ',NULL,'Ceo.narziya@gmail.com',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$GVjjfCb2r3ng8Sau.KfXzOgcK04l.kkKOT69x.BBpopK38HHRLarK','     Мы представляем продукцию торговой марки \"Stuff\", которая выпускается на совместном Узбекско-Российско-Английском предприятии \"Amin Invest International\", основанном в 1994 году. \r\n Технологический процесс производства состоит из четырех основных этапов:\r\n     1. Переработка хлопкового волокна и выпуск хлопковой 100% пряжи осуществляется на современном оборудовании компаний: RIETER Швейцария, SCHLAFHORST Германия , SAVIO Италия , укомплектованных системами автоматического контроля качества пряжи USTER и COROLAB \r\n     2. Выработка трикотажного полотна (supreme , pike , footer 2х и 3х ниточный) производится на кругловязальных машинах с программным управлением PAOLO ORIZIO Италия , MASA Тайвань и плосковязальных машинах MATSUYA Япония и MASA Тайвань на которых предусмотрено изготовление различного ассортимента плосковязальной продукции. \r\n    3. Крашение и отбелка трикотажа происходит в современных высокотехнологичных красильных комплексах BENEKS MAXI FLUX 600-900 (Турция), позволяющих сократить на 30 % потребление воды и на 40% время крашения, что дает ощутимую экономию. Процесс крашения полностью автоматизирован. Отжим полотна осуществляется на специальном оборудовании BENEKS Турция. Наличие подачи воздуха и регулируемые прижимные валы позволяют избежать ломки структуры полотна. Мягкая многоступенчатая сушка полотна осуществляется на сушильном комплексе YILMAS Турция, где контролируется температурный режим и время нахождения в температурных камерах с целью недопущения пересушки полотна. Процесс глажки полотна происходит на специальном оборудовании KALANDR SERTEKS где наряду с непосредственно глажкой происходит выравнивание полотна и достигается необходимая его ширина. \r\n        4. Крой трикотажного полотна, являющийся одним из главных приоритетов в швейном производстве осуществляется на автоматическом настилочном комплексе RIMOLDI Италия и настилочном комплексе OZBILIM, на раскройных столах RIMOLDI Италия. Пошив трикотажных изделий происходит на промышленных швейных машинах европейского класса VEGA, SIRUBA, BROTHER, RIMOLDI, NECCHI, PFAFF. Ежемесячный объем производства составляет 290 000 – 300 000 высококачественных единиц трикотажных изделий, о чем свидетельствует тот факт, что основная масса их экспортируется за рубеж. \r\n           Для дальнейшего увеличения экспортного потенциала, улучшения ассортимента и качества выпускаемой продукции было принято решение о начале производства нового вида продукции – кольцепрядильной пряжи NE-30. В настоящее время завезено, установлено и проводятся пусконаладочные работы на новом комплексе оборудования корпорации «СТМТС» China. Ввод нового комплекса позволит каждый год производит 1800 тонн высококачественной пряжи, которая широко востребована в странах СНГ и дальнем зарубежье. \r\n      Предприятие специализировано на выпуске готовых изделий из трикотажного хлопчатобумажного полотна, имеет циклический характер:\r\n        1.	Переработка хлопка-волокна в пряжу. \r\n        2.	Выработка хлопчатобумажного полотна. \r\n        3.	Обработка хлопчатобумажного полотна. \r\n        4.	Пошив готовых изделий. \r\n     На производстве внедрена технология швейцарского, итальянского и турецкого производства:\r\n        1.	На переработку хлопка-сырца внедрена швейцарская технология фирмы «Rieter» \r\n        2.	На производство пряжи- внедрена итальянская технология фирмы «Savio», она представляет собой автоматическую линию с программным управлением. \r\n        3.	Производство полотна производится по технологии итальянской фирмы «Orizio», она представляет собой вязальные машины с программным управлением. \r\n        4.	Отбелка и крашение полотна производится по итальянской и турецкой технологиям, производится на автоматических линиях фирм «Ferraro» и «Kromsan». \r\n        5.	Производство готовой продукции производится по итальянской и турецкой технологии на автоматических линиях фирм «Rimoldi» и «Necci». \r\n        6.	Современные технологии по переработке хлопка-сырца и производству готовой продукции позволяют производить до 2500000 готовых изделий в течение года. \r\nОрганизация работы рассчитана на 3-х сменный режимы в прядильном и трикотажном производстве, 2-х сменный режим - в красильном, 1 сменный режим в швейном производстве. \r\n       Производство готовой продукции с использованием 100% хлопка – волокна на экспорт заслужило широкую популярность, благодаря применению натуральных материалов и удержания низких цен для потребителя.',NULL,NULL,'+998909207111 +7-499-755-55-05 +7-926-785-59-10',NULL,NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/tn/8o/2y/cc543697-b809-4387-a324-ee2bb266edb5.jpg',0.00,NULL,NULL,'2025-08-04 16:40:22','2025-08-04 16:40:22'),(2199,'СП \"Ганий угуллари\"','Marhaba',NULL,'botya3x@yandex.ru',NULL,'2','Узбекистан',0.00,1,'1','2018','member','$2y$10$CMPbNoLjcUzD0huLrxG.c.U0l4ZXqJyUsxYuaq0SPsEeI7UrvbK5e','детская и подростковая одежда',NULL,NULL,NULL,NULL,NULL,'','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:40:23','2025-08-04 16:40:23'),(