тво трикотажной ткани\r\n-Производство джинсовой ткани\r\n-Производство трикотажной одежды для взрослых и детей\r\n-Производство джинсовой одежды для взрослых и детей\r\n-Варка джинсовых изделий\r\n-Производство корпоративной одежды\r\n\r\nПроизводственная мощность швейного предприятия – более 1,880,000 трикотажных изделий в год.\r\n\r\nПроизводственная мощность красильного производства - более 450 000 кг/месяц\r\n\r\nПроизводственная мощность предприятия по производству джинсовой ткани - 5.000.000 погонных метров/год\r\n\r\nИнтересная особенность предприятия по производству трикотажного полотна является то что ORZU-TEKS производит полотно BODY SIZE (что означает возможность изготовления полотна без боковых швов). Это обеспечивается за счет имеющегося кругловязального оборудования от 13 до 22 дюйма под любой размер тела (объем груди от 37 до 64 см). \r\n\r\nORZU-TEKS выполняет оригинальные заказы по изготовлению нестандартных изделий и обладает возможностью многотиражной печати на материале (при заказе не менее 10,000 единиц одной модели). Налаженное в Узбекистане промышленное производство трикотажного белья с вертикально интегрированным контролем качества позволяет ORZU-TEKS поставлять на экспорт более 90% объема продукции.\r\n\r\nПри окраске полотна собственного производства используется сверхстойкое активное крашение, которое обеспечивает яркость и насыщенность цветов, и минимальную усадку в течение долгого времени службы.',NULL,'@modern_uzb ','+998901750025','www.orzutex.uz','+998901750025','','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/vt/ys/al/296171cd-7ef5-4d0a-a3f5-ba2caead5809.jpg',0.00,NULL,NULL,'2025-08-04 16:40:27','2025-08-04 16:40:27'),(2212,'СП ООО \"PLASTEKS\"','',NULL,'abror@plasteks.uz',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$85uLCzY2BD7w65Te1TBDiuNPMkLgrJH0Z4FKkCBpnz7C.4X80VQGu','Производство пряжи, суровое и окрашенное трикотажная полотно',NULL,NULL,'+998711481445','www.plasteks.uz',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/s0/m7/30/489c73e3-6378-49cd-a4e6-844135d58807.jpg',0.00,NULL,NULL,'2025-08-04 16:40:28','2025-08-04 16:40:28'),(2213,'СП ООО \"REPROCESSING UZ\"','СП ООО \"REPROCESSING UZ\"',NULL,'sales@sales.uz',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$DKhX.mxuDMsHM17Yd4p4n.uEZj5QV5cCP1ePkr4tGVxWEPAL6AEYK','Совместно Узбекское Корейское предприятие «Reprocessing Uz» является одним из крупнейшим предприятием в республике Узбекистан по производству ПЭТ волокна. Наше предприятие в январе 2013 года приобрело высокотехнологичное передовое оборудование компании «Worldro Co.LTD.», (Южная Корея) по производству регулярного ПЭТ волокна, прошедшее международную сертификацию. В ноябре 2014 года была приобретена вторая линия  компании «Worldro Co.LTD.» для производства полого волокна. Наши специалисты прошли 6-ти месячную стажировку на передовых предприятиях в Южной Кореи выпускающих ПЭТ волокно. В сентябре 2013 года наше предприятие успешно прошло международную сертификацию со стороны немецкого органа сертификации компании DQS и получила сертификат ISO 9001:2008.Мощность предприятия 1000 тонн ПЭТ волокна в месяц.',NULL,NULL,'+998970000000',NULL,NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/03/zd/0n/dab78a8b-f55e-432a-ad89-560c9ee8e4c8.png',0.00,NULL,NULL,'2025-08-04 16:40:28','2025-08-04 16:40:28'),(2214,'СП ООО \"Rodopoli Textile\"','Rodopoli',NULL,'rodopoli.uz@gmail.com',NULL,'1','Узбекистан',0.00,1,'2','2024','member','$2y$10$n2VOwnlJE4P1Anckg9CVeug7O1miPBBN6mnGc6ON4pw4ktYSmQVNO','разработка дизайна, пошив коллекций',NULL,'+998900656565','+998900656565',NULL,NULL,'','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:40:28','2025-08-04 16:40:28'),(2215,'СП ООО \"SANOAT GILAM\"','',NULL,'sg.savdo@gmail.com',NULL,'7','Узбекистан',0.00,1,'0','','member','$2y$10$La1rK6yoDbu9f0JCBI0EWuW/iezdt0Sefp/nOzC9Z4D8utVY2HVEi','Мы компания «Sanoat Gilam»  занимаемся производством напольных покрытий (к