L,NULL,'+998908069600','briolini.net',NULL,'','company','https://uzbtextile.s3.ap-northeast-1.amazonaws.com/public/v001/v2/d4/uv/fd8df281-9b41-4cb7-af59-9f7e34c16a8f.jpg',0.00,NULL,NULL,'2025-08-04 16:40:42','2025-08-04 16:40:42'),(2263,'ЧП \"MIRKANS\"','BARKOD.UZ',NULL,'alisher@mirkans.uz',NULL,'7','Узбекистан',0.00,1,'1','2012','member','$2y$10$BOMPbh6S5VlmibD2hYMka.L08gKrS/RuSoSWYL4GfqdCnFlzPnUeG','Argox — мировой лидер в производстве принтеров для печати этикеток и сканеров штрих-кодов.\r\n\r\nArgox производит полную линейку устройств для учета и контроля посредством маркировки штрих-кодом.\r\n\r\nТовары под маркой Argox широко известны в 70 странах мира.\r\n\r\nArgox сосредоточил свои силы на производстве устройств для малого и среднего бизнеса, разработал собственные KNOW-HOW, и в сотрудничестве с лучшими производителями ПК на Тайване создал самые конкурентноспособные модели по очень выгодной цене.\r\n\r\nВысокое качество изделий, надежность, совместимость с различным ПО и компьютерными системами разных производителей — отличительная черта устройств Argox.\r\n\r\nОсновная продукция Argox —  принтеры этикеток штрих-кода, сканеры штрих-кодов, и портативные терминалы данных.\r\n\r\nПродукция Argox используются во всем мире на заводах, больницах, аэропортах, почтовых отделениях и торговых точках.\r\n\r\nArgox продолжает расширять свои производственные линии и выходить на новые рынки, ежегодно увеличивая вдвое свой оборот.\r\n\r\nЗадача Argox — дать клиентам:\r\n\r\nполный спектр инновационных продуктов исключительного качества,\r\nнизкую стоимость продукции\r\nнастраиваемые и масштабируемые решения\r\nбыстроту и эффективность работы.\r\nArgox — эксперт штрихового кодирования!',NULL,'barkod_uz','+998901859989','barkod.uz','+998971577750','','company','/avatars/default.png',0.00,NULL,NULL,'2025-08-04 16:40:48','2025-08-04 16:40:48'),(2264,'ЧП \"Nishon Group Product\"','Nishon Group',NULL,'baxtiyor_86@inbox.ru',NULL,'7',NULL,0.00,1,'0','','member','$2y$10$ryPJUMlVY3d